DROP TABLE IF EXISTS `t_user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `t_user` (
  `user_id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'ユーザID',
  `mail_address` varchar(256) NOT NULL COMMENT 'メールアドレス',
  `password` varchar(64) DEFAULT NULL COMMENT 'パスワード',
  `google_access_token` varchar(256) DEFAULT NULL COMMENT 'Google認証情報(アクセストークン)',
  `google_reflesh_token` varchar(256) DEFAULT NULL COMMENT 'Google認証情報(リフレッシュトークン)',
  `guest_token` varchar(40) DEFAULT NULL COMMENT 'ゲストトークン',
  `guest_limit` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `guest_flg` tinyint unsigned NOT NULL DEFAULT (0) COMMENT 'ゲストフラグ 0:社員、1:ゲスト',
  `engineer_flg` tinyint unsigned NOT NULL DEFAULT (0) COMMENT 'エンジニアフラグ 0:エンジニア、1:営業、2:その他',
  `reviewee_flg` tinyint DEFAULT '0',
  `reviewer_flg` tinyint DEFAULT '0',
  `guest_reviewer_flg` tinyint DEFAULT '0',
  `member_id` varchar(20) DEFAULT NULL,
  `review_message` text,
  `lock_flg` tinyint unsigned NOT NULL DEFAULT (0) COMMENT 'アカウントロックフラグ 0',
  `condition_flg` tinyint unsigned NOT NULL DEFAULT (0) COMMENT '希望条件フラグ',
  `del_flg` tinyint unsigned NOT NULL DEFAULT (0) COMMENT '削除フラグ',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '登録日',
  `create_id` int unsigned DEFAULT NULL COMMENT '登録者ID',
  `modify_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新日',
  `modify_id` int unsigned DEFAULT NULL COMMENT '更新者ID',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=212 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='ユーザ情報';
