--
-- Table structure for table `t_user_basic`
--

DROP TABLE IF EXISTS `t_user_basic`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `t_user_basic` (
  `user_id` int unsigned NOT NULL COMMENT 'ユーザID',
  `last_name` varchar(256) NOT NULL COMMENT '姓',
  `first_name` varchar(256) NOT NULL COMMENT '名',
  `last_name_kana` varchar(256) NOT NULL COMMENT 'セイ',
  `first_name_kana` varchar(256) NOT NULL COMMENT 'メイ',
  `initial` varchar(3) NOT NULL COMMENT 'イニシャル',
  `birthday` varchar(8) NOT NULL COMMENT '生年月日',
  `gender` tinyint unsigned NOT NULL DEFAULT (0) COMMENT '性別 0:男、1:女',
  `station` varchar(256) DEFAULT NULL COMMENT '最寄り駅',
  `real_years` varchar(2) DEFAULT NULL COMMENT '実年数(年)',
  `real_month` varchar(2) DEFAULT NULL COMMENT '実年数(月)',
  `start_year` varchar(4) DEFAULT NULL COMMENT '稼働開始可能月(年)',
  `start_month` varchar(2) DEFAULT NULL COMMENT '稼働開始可能月(月)',
  `my_pr` text COMMENT '自己PR',
  `condition_text` text COMMENT '希望条件',
  `experience` tinyint unsigned DEFAULT NULL COMMENT '経験人数 0:5人以下、1:5人以上10人以下、2:10人以上15人以下、3:15人以上',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '登録日',
  `create_id` int unsigned DEFAULT NULL COMMENT '登録者ID',
  `modify_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新日',
  `modify_id` int unsigned DEFAULT NULL COMMENT '更新者ID',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='ユーザ基本情報';
/*!40101 SET character_set_client = @saved_cs_client */;

