INSERT INTO `t_user_basic` VALUES (1,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-25 21:45:20',NULL,'2022-08-01 22:33:25',1),(15,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-25 21:45:20',NULL,'2022-07-28 22:23:34',1),(16,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-25 21:47:13',NULL,'2023-03-31 06:36:38',1),(17,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-25 21:49:28',NULL,'2022-07-28 22:23:55',1),(18,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-25 21:51:29',NULL,'2022-07-28 22:24:07',1),(19,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-25 21:53:02',NULL,'2024-01-23 01:15:42',1),(20,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-25 21:56:40',NULL,'2022-07-28 22:24:29',1),(21,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-25 21:59:00',NULL,'2022-07-28 22:24:40',1),(22,'名字','名前','ミョウジ','ナマエ','N.M','19660911',0,'大宮','24','0','2023','06','開発エンジニア（PG→SE→PL/PM）を約18年、ITコンサルタント3年、プロジェクト配属以外はSI営業10年経験しております。PG/SEでは戦力として厳しいですが、今までの経験を生かしたPM/PMO業務領域を得意としております。\r\nまた、作業範囲は、システム企画、他システム連携の調査分析を始め、RDB設計や下流工程の設計経験を生かした業務が対応可能です。',NULL,NULL,'2022-07-25 22:03:35',NULL,'2023-05-18 07:44:36',22),(23,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-25 22:04:54',NULL,'2023-03-31 06:35:39',1),(25,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-25 23:31:51',NULL,'2022-09-28 01:35:35',1),(26,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-25 23:36:23',NULL,'2022-07-28 22:25:56',1),(27,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-25 23:38:23',NULL,'2022-07-28 22:26:08',1),(28,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-25 23:44:47',NULL,'2022-07-26 13:38:28',1),(29,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-25 23:47:38',NULL,'2022-07-26 13:38:41',1),(30,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-25 23:49:20',NULL,'2022-07-26 13:39:27',1),(31,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-26 17:00:35',NULL,'2022-07-26 13:39:52',1),(32,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-26 17:02:44',NULL,'2022-07-26 13:40:04',1),(33,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,'2022-07-26 17:05:03',NULL,'2023-06-19 07:49:45',33),(34,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-26 17:06:56',NULL,'2022-07-26 13:40:33',1),(35,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-26 17:09:40',NULL,'2022-07-26 13:40:42',1),(36,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-26 17:10:55',NULL,'2022-07-26 13:40:54',1),(37,'名字','名前','ミョウジ','ナマエ','N.M','19820101',0,'京浜東北線　南浦和',NULL,NULL,NULL,NULL,'現場では最終的な目的を念頭に、業務効率向上の観点を基に積極的に従事することを心掛けております。複数部門との連携も多数経験しており、円滑なコミュニケーションにより、認識齟齬による業務のやり直しが発生しない様に注力しております。',NULL,NULL,'2022-07-26 19:59:58',NULL,'2022-08-16 12:39:34',79),(38,'名字','名前','ミョウジ','ナマエ','N.M','19971017',0,'大船','3','4','2024','01','日々新しい技術が広まる中、知識が足りない分\"成長\"を目標に精進していきたいです。教育にも興味がある為、ITと教育が関係した分野に携わることが目標です。私は人との関係を重視し、技術は勿論、周囲の人から必要とされる技術者を目指し日々精進しております。学生時代に授業で、Java,CSS,Javascript等を学び、卒業研修ではPythonを扱ってAIを使った画像判別器の作成を行いました。',NULL,4,'2022-07-26 20:02:35',NULL,'2023-11-10 04:09:02',38),(39,'名字','名前','ミョウジ','ナマエ','N.M','19950801',1,'東十条','4','6',NULL,NULL,'時間を常に意識しており、遅刻することがないよう早めの行動を心掛け、業務においても時間の計画を立てて作業を進めます。\r\n物事に対して第三者の視点から思考し、取り組むことを心掛けております。',NULL,4,'2022-07-26 20:03:59',NULL,'2022-10-04 11:32:27',39),(40,'名字','名前','ミョウジ','ナマエ','N.M','20000212',0,'京急本線　平和島駅',NULL,NULL,NULL,NULL,'研修内では少数人ではありますが、チームの勤怠や提出物、進捗などを管理するリーダーを務め、漏れがないよう日々どのようなタスクをいつまでに完結させないといけないのかなどを管理し、必要に応じて上司に報告を行っておりました。このような経験からやるべきタスクの優先順位をつけて、定められた期日内に消化し、報連相を怠らないよう業務に取り組むことを重視しています。',NULL,4,'2022-07-26 20:05:29',NULL,'2022-08-26 08:29:38',40),(41,'名字','名前','ミョウジ','ナマエ','N.M','19780208',0,'京浜東北線・京急　鶴見駅','20',NULL,NULL,NULL,'技術者には技術力だけではなく自己管理能力も必要だと考えるため、体調管理には常に気をつけております。\r\n効率よくかつ正確に業務をこなす上でコミュニケーションが重要だと考えるため、プロジェクトに関わる方とのコミュニケーションには特に気をつけるよう努めています。\r\n分からない技術や経験のない業務を担当する場合でも自分のためになる新しい知識を得る機会と捉え、何事にも挑戦するよう心がけています。\r\n今までの業務経験を経て培った知識を活かし、プロジェクト成功に貢献しつつ、若手をサポートできるような技術者になることを目指しています。',NULL,NULL,'2022-07-26 20:12:25',NULL,'2022-09-07 03:41:49',114),(42,'名字','名前','ミョウジ','ナマエ','N.M','19790913',0,'北本','14','0',NULL,NULL,'体調管理には常に気をつけており、体調不良で業務を滞らせることはございません。\r\n目的や目標の具体化・共通化を行って業務に従事することを心掛けております。\r\n「エンドユーザの使いやすさ」を念頭に、同時に「納期の厳守」を意識しながら作業を進めます。',NULL,0,'2022-07-26 20:15:36',NULL,'2024-04-02 00:41:07',1),(43,'名字','名前','ミョウジ','ナマエ','N.M','19860317',0,'東部東上線　朝霞台','14','5',NULL,NULL,'要件定義～運用保守まで一連の工程は経験済み。\r\n経歴上バッチ開発に携わる機会が多かったですが、直近でフロント案件の要件整理と開発管理を実施済。\r\nまた要件定義ではお客様や他シス調整を実施した経験もあるため、外部との調整事項も問題なく実施可能です。',NULL,NULL,'2022-07-26 20:17:49',NULL,'2023-06-16 02:06:53',132),(44,'名字','名前','ミョウジ','ナマエ','N.M','19940316',0,'京王稲田堤','5','3',NULL,NULL,'上流から下流まで幅広く業務を経験させて頂いております。特にバッチ処理の設計、実装の経験が多く、各工程の要所は押さえております。\r\n特に直近の案件では、それまで参画してきた複数の案件の経験を活かし、ドキュメントのフォーマット作成やVBAツールの作成、結合試験の進め方の提案などを行ってきました。\r\nシステムエンジニアとしては「コミュニケーション力」、「技術力」、「段取り力」が重要な3要素だと考えており、この3つを意識し業務に取り組んでおります。',NULL,4,'2022-07-26 20:21:03',NULL,'2022-09-07 03:42:17',114),(45,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-07-26 20:23:40',NULL,'2022-07-26 20:23:40',NULL),(46,'名字','名前','ミョウジ','ナマエ','N.M','19970526',1,'瑞江','2',NULL,NULL,NULL,'2021年7月よりオンラインプログラミングスクールのフロントエンドの開発を行い、現在は企業研修の講師チームとして準備を行っております。まだ周りの方の力をお借りしなければならないことも多いですが、今後もフロントエンドの開発業務に携わっていきたいと思っております。そのために様々なことを経験したいと考えているので、やったことのない事も積極的に挑戦していきたいと考えております。',NULL,4,'2022-07-26 20:25:55',NULL,'2023-03-31 06:33:25',1),(47,'名字','名前','ミョウジ','ナマエ','N.M','19911222',0,'川名','7',NULL,NULL,NULL,'海外オンサイト、ならびに、英語のドキュメント作成経験があり、英語には抵抗ありません。\r\nプロジェクトに関する技術のキャッチアップが必要になる際は、ベストプラクティス等の方法論も確認し、成果物の品質を保てるよう努めております。',NULL,0,'2022-07-26 20:27:26',NULL,'2023-03-31 06:28:34',1),(48,'名字','名前','ミョウジ','ナマエ','N.M','19910420',0,'日比谷線三ノ輪','7','5',NULL,NULL,'前職では約6年間、開発担当として主に自社サービスであるサイト内検索システムの導入プロジェクトにおいて、要件定義から設計、プログラミング、テスト、導入、保守まで一貫した工程に従事しておりました。顧客ごとにカスタマイズ開発を行い、主にLAMP環境での開発を得意としております。現場での開発だけでなく、主任にあたる役割としてマネジメントも行っていました。\r\n※前職で行ったプロジェクトはかなり多いため経歴に一覧に記載のプロジェクトは一部抜粋したものとなります。\r\n\r\n現在はデジタルコンテンツ配信事業の特典サービスの導入プロジェクトを半年ほどしており、\r\n設計、プログラミング、テストを行っています。',NULL,4,'2022-07-26 20:28:49',NULL,'2023-03-31 06:28:10',1),(49,'名字','名前','ミョウジ','ナマエ','N.M','19990530',0,'西調布','2','0',NULL,NULL,'学生の頃に静的なHP作成の案件を請け負っていたので、WEBのフロントエンドは自身があります。その際に、デザイナーとしてＨＰのデザインもしていたので、デザインも多少担当できます。\r\n新卒研修のチームビルディングでは、サブリーダーとして技術面での補佐をし、設計や不明点の相談にのり、チームに貢献しました。',NULL,4,'2022-07-26 20:30:57',NULL,'2024-03-05 06:13:14',49),(50,'名字','名前','ミョウジ','ナマエ','N.M','19970517',0,'常磐線南柏','0','5',NULL,NULL,'体調、スケジュール管理には常に気を遣い、欠勤や遅刻などで業務を滞らせることはありません。\r\nまた、タスク管理を徹底し、納期漏れがないよう努めています。\r\n多くの技術をインプットし、それをアウトプットすることによって技術が確実に定着するように心掛けています。\r\n人とコミュニケーションを取ることが得意なので研修のチームビルディングではコミュニケーションを密にとり作業を円滑に進めました。また気付きがあったときには意見もしてより良いものが作れるよう努めました。',NULL,4,'2022-07-26 20:32:32',NULL,'2023-03-31 06:20:35',1),(51,'名字','名前','ミョウジ','ナマエ','N.M','19820521',0,'新狭山','18','7',NULL,NULL,'指示された作業だけではなく、能動的・積極的に業務に従事することを心掛けております。\r\nお客様の要望をもとにより良い提案を出来るように心掛けております。',NULL,1,'2022-07-26 20:35:34',NULL,'2024-03-22 02:22:18',51),(52,'名字','名前','ミョウジ','ナマエ','N.M','19950809',0,'京王線　笹塚','4','4',NULL,NULL,'業務において、受動的ではなく、能動的・積極的に従事することを心掛けております。\r\n若手であることを意識して貪欲な気持ちで幅広く多くの技術を学ぶ姿勢を持っています。\r\n他のメンバーとコミュニケーションを取り、効率的に業務を進めることを心掛けております。',NULL,4,'2022-07-26 20:41:52',NULL,'2023-07-05 05:15:02',52),(53,'名字','名前','ミョウジ','ナマエ','N.M','19981216',1,'和光市','2','0','2023','07','SQLを中心にデータ加工を行う現場で、主にShellscript、Talendを用いたツールの作成および実行確認テストを行っておりました。\r\nほか作業としてマクロの作成、および個人でJavaの学習を行っております。\r\nまた、現在別途セキュリティマネジメント資格獲得に向けた学習に取り組んでいます。',NULL,4,'2022-07-26 20:43:13',NULL,'2024-04-02 00:44:31',1),(54,'名字','名前','ミョウジ','ナマエ','N.M','19900718',0,'鷺沼','4','6','2024','06','直近2年は携わる案件でリーダーポジションに就いて業務に努めており、技術は勿論のこと\"人を動かす・扱うこと”に興味があるので業務を通じて研鑽を積んでいます。進捗・課題・メンバー管理を行う傍らで開発メンバーとしても手を動かすことでクライアント、PM、メンバーとの調整役を担って認識齟齬等の問題を未然に防いだり、作業見積やリスケジュールを柔軟に対応することが得意です。加えてPJメンバーの教育にも力を入れており、新人には一人称で動けるように、2年目以上のメンバーにはリーダー業務ができるよう働きかけております。商流の垣根を越えて一枚岩になってプロジェクト完遂を目指すことを第一に今後もリーダーシップに磨きをかけていく所存です。',NULL,2,'2022-07-26 20:44:37',NULL,'2024-03-18 03:38:54',54),(55,'名字','名前','ミョウジ','ナマエ','N.M','19950509',0,'生田','3','8','2022','10','私は自発的に行動出来る点がアピールポイントです。\r\n自身でゴールとして設定したことに対して、考え、行動し、検証することが出来ます。\r\n新たな知識や技術に対して、まずは触ってから考える精神で行動することを重点において日々の業務に取り組んでおります。\r\nまた、至極当たり前のことではありますが、報連相の徹底をしております。事実ベースの報告、自分の考えの相談、円滑に動くための連絡等はこまめに行うことを徹底しております。',NULL,4,'2022-07-26 20:46:49',NULL,'2023-06-19 03:33:45',58),(56,'名字','名前','ミョウジ','ナマエ','N.M','20000807',0,'JR 埼京線 北赤羽','0','10','2024','05','私は専門学校で3年間、プログラミングを学びました。\r\nこの期間を通じて、プログラミングの基礎から高度なスキルまでを習得し、資格取得にも力を注いでまいりました。\r\n合格した応用情報技術者試験や情報処理安全確保支援士試験の知識を実務に活かして貢献できると考えております。\r\nまた、最近ではAWS ソリューションアーキテクト資格も取得し、クラウドの基本知識もございます。\r\n\r\n現在の配属先では、1年以上にわたりプロジェクトの基本設計から実装、試験、リリースまでの開発プロセスを担当しております。\r\n\r\nまた、チーム内でサブリーダーを担当しており、メンバーの進捗管理や成果物レビュー、フォローを行っております。',NULL,4,'2022-07-26 20:48:46',NULL,'2024-03-03 22:58:39',56),(57,'名字','名前','ミョウジ','ナマエ','N.M','19990411',1,'丸の内線　荻窪',NULL,'5',NULL,NULL,'頂いた仕事は、計画性を持ったうえで必ず最後まで、納期厳守を前提にやり切ります。業務内でのズレが生じないよう、日々のコミュニケーションを大切にします。チームビルディングや業務で培った納期厳守で終わらせる計画性と、学生時代での、知識０の状態から自分でプログラミングを学ぶ環境を作る行動力、学習意欲を生かして、貴社に貢献できるよう精進してまいります。何卒宜しくお願い致します。',NULL,1,'2022-07-26 20:50:25',NULL,'2022-12-23 01:57:39',57),(58,'名字','名前','ミョウジ','ナマエ','N.M','19881106',0,'総武線 市川','6','2',NULL,NULL,'接客業に7年携わってきました。\r\nその経験から培われたコミュニケーション能力や突発的なトラブルへの対応力を生かし、\r\n能動的・積極的に従事することを心掛けております。\r\n新卒の技術フォローや外部企業へのプログラミング研修講師等の経験から、\r\n教育・育成といった分野では、何を質問されても答えられるように、\r\n常に新しい知識・技術を身に着けていけるよう学習を続けております。',NULL,2,'2022-07-26 20:53:21',NULL,'2023-08-01 02:45:57',58),(59,'名字','名前','ミョウジ','ナマエ','N.M','19810117',0,'JR 中央線 西八王子','5','2','2023','07','受動的ではなく、能動的・積極的に従事することを心掛けております。\r\n謙虚な気持ちを忘れず、自ら技術を学んでいく姿勢で業務に取り組んでおります。\r\n外部企業への研修講師の経験から、教育・育成といった分野では、何を質問されても答えられるように、\r\n常に新しい知識・技術を身に着けていけるよう学習を続けております。',NULL,4,'2022-07-26 21:04:07',NULL,'2023-09-21 14:17:07',1),(60,'名字','名前','ミョウジ','ナマエ','N.M','19980307',1,'船橋法典','2','4','2022','08','日々、筋トレやストレッチに励み、免疫力をあげることで健康を維持しています。優れない場合は無理しすぎず切り上げるなどして体調管理をしています。\r\n前現場では、自身のタスク管理に加え、チーム全体を見て進捗に合わせてメンバーのサポートを積極的に行ってきました。\r\n自分にできることは何かを常に考え、先回りして作業することを心がけています。また、何事にも好奇心旺盛なので業務に対しても積極的に取り組むことができます。\"',NULL,4,'2022-07-26 21:06:21',NULL,'2023-03-31 06:27:11',1),(61,'名字','名前','ミョウジ','ナマエ','N.M','19970707',0,'西武新宿線　都立家政','2','4','2022','10','大学卒業後、２社でシステム運用保守・開発の経験を積みました。\r\n２社目では運用保守の業務を行いつつ、システムの機能追加開発をメインで担当し、\r\n詳細設計から開発・テストまで対応しておりました。\r\nブラックボックス化していた処理を解読してチーム内で勉強会を開いて共有するなど、\r\n業務改善にも積極的に取り組みました。\r\nまた、エラー発生時の対応方法など、障害対応が迅速に行えるような資料作成も実施するなど、通常業務と並行して別途課題を発見し、自身が現場を抜けた後のことも考慮して日々業務を行なっております。',NULL,4,'2022-07-26 21:33:14',NULL,'2023-03-31 06:24:03',1),(62,'名字','名前','ミョウジ','ナマエ','N.M','19981105',0,'ちはら台','2','5','2022','08','10年程空手を習っていた経験から、体の丈夫さには自信があり、大きく体調を崩すことは滅多にありません。\r\n大学生時代は、部活で部長を務め、チームを率いる経験をしました。報連相の徹底を当時から行っており、現在でも継続して徹底する事を心掛けています。\r\n2021年４月からエンジニアとしてのキャリアをスタートさせましたが、ゆくゆくは体が不自由な人向けのコミュニケーションアプリを開発したいと考えています。\r\n現在はJava、PHPを突き詰めて学んでいきたいと考えており、開発エンジニアとして日々勉強していく所存です。',NULL,4,'2022-07-26 21:34:36',NULL,'2022-09-07 03:46:06',114),(63,'名字','名前','ミョウジ','ナマエ','N.M','19970402',0,'本八幡',NULL,'1',NULL,NULL,'学生時は自分の研究室の専門外であるVRのシステム構築を研究で取り組み、自分で調べながら研究を進めていました。なので、新しい業務にも前向きに取り組んでいきます。\r\nまた、大学の部活では主将の経験もあるので、業務に対しても主体的に取り組んでいきます。\r\n何卒よろしくお願いいたします。',NULL,4,'2022-07-26 21:35:38',NULL,'2022-09-07 03:46:16',114),(64,'名字','名前','ミョウジ','ナマエ','N.M','19991226',1,'JR高崎線　上尾','1','8',NULL,NULL,'与えられた仕事に対して最後まで責任をもって全力でやり遂げ、納期厳守で取り組みます。内容の理解に時間がかかる部分もありますが、その分理解できるまで問題と向き合う忍耐力と、問題解決のための質問を怠らない姿勢を大事にしています。将来的には、後輩からの質問や疑問に対して簡潔にわかりやすく説明ができるようになり、なおかつ技術力もしっかりある、後輩教育のできる技術者を目指しています。未熟な部分も多いですが、ひたむきな姿勢を絶やさず頑張ります。よろしくお願いいたします。',NULL,4,'2022-07-26 21:36:53',NULL,'2024-04-02 00:45:07',1),(65,'名字','名前','ミョウジ','ナマエ','N.M','19790127',0,'一ノ割','16','5','2023','10','各顧客からの要望、改善依頼などをヒアリングし\r\nシステムの要件定義を行い、設計、開発、コーディング、テスト、納品まで一貫した業務経験があります。\r\n顧客とのコミュニケーションやチーム内でのコミュニケーションなど人間関係を重視して業務を遂行して\r\n参りました。',NULL,NULL,'2022-07-26 21:38:01',NULL,'2023-08-25 13:58:20',65),(66,'名字','名前','ミョウジ','ナマエ','N.M','19791029',0,'南武線　武蔵新城','15','8',NULL,NULL,'常に新しい知識、技術に興味を持っており、全く知見のない言語・環境でも積極的に取り組めます。また、前例のない困難な業務でも主体性を持って取り組み、やり遂げるための実績と経験があります。業務を知り、ユーザに真に必要なシステムの提案・構築ができる技術者を目指し日々精進しております。\r\n※尚、上記実務経験には記載できませんが、現在自己学習にてVue.js/Dockerに係る知見を深めております。',NULL,1,'2022-07-26 21:40:16',NULL,'2023-12-07 05:58:05',132),(67,'名字','名前','ミョウジ','ナマエ','N.M','19970906',0,'和光市','3','0','2022','09','約3年間、Javaを用いたバックエンドAPIの開発に従事して参りました。',NULL,4,'2022-07-26 21:41:33',NULL,'2023-09-12 01:59:42',67),(68,'名字','名前','ミョウジ','ナマエ','N.M','19970610',1,'東武野田線　六実','2','11','2023','04','毎朝自主学習する時間を設け、知識を定着させることを大事にしています。主にLaravelでの開発を行っていましたが、ReactやNext.jsに関しても自主学習で日々技術を高めています。また、問題にぶつかったときの自己解決能力があり、自力で原因を突き止めて問題を解決することが得意です。今までに触れたことのない分野でも常に好奇心を持って取り組み吸収していきます。',NULL,0,'2022-07-26 21:42:44',NULL,'2023-03-06 01:38:03',68),(69,'名字','名前','ミョウジ','ナマエ','N.M','19980122',0,'向ヶ丘遊園','3','6','2024','01','学生時代にC、Javaを講義で基本的な部分は学習しており、コーディングに対する飲み込みは早いと考えております。また、卒業研究にて、VIVE PRO,Unityを用いたVR,ARの開発をするなど、新しい技術への関心も持っております。\r\n今までの案件では主に開発業務の経験が多く、java,php,vue.js,typescript,golangなど、幅広く経験があります。\r\n自分の知らないことを学んだり、知っていることを活かすことが好きなので、どのような業務でも取り組んでいくことができます。',NULL,4,'2022-07-26 21:43:50',NULL,'2023-11-20 07:35:28',69),(70,'名字','名前','ミョウジ','ナマエ','N.M','19990629',0,'東急田園都市線 あざみ野','0','5',NULL,NULL,'普段は早寝早起きを意識して体調管理を徹底することで、無遅刻無欠勤を徹底しています。\r\nまた、私の強みはやると決めたことに対して最後までやり切る力です。小学校から現在までテニスを続けてきて継続力には自信があります。実際にプロジェクトに配属されたら自分に任された仕事は締切厳守でやり切り、実務経験を通して様々な知識を積極的に吸収していきたいと考えています。\r\n将来的には開発もインフラも扱えるフルスタックエンジニアを目指しています。',NULL,4,'2022-07-26 21:45:15',NULL,'2024-04-02 00:48:02',1),(71,'名字','名前','ミョウジ','ナマエ','N.M','20000111',0,'中河原','1','10','2023','05','タスク管理・報連相を徹底し、納期漏れが発生しないよう日々業務に取り組んでおります。\r\nまた、指示された作業だけでなく、能動的に業務に従事することを心掛けています。\r\n現場で自身のスキルが最大限発揮できるよう、意欲的に日々の学習に取り組んでおります。',NULL,4,'2022-07-26 21:46:29',NULL,'2024-03-05 06:21:05',71),(72,'名字','名前','ミョウジ','ナマエ','N.M','19911105',0,'有楽町線・副都心線 地下鉄赤塚','6','3','2023','07','「慎重かつ丁寧に」を念頭に考えつつ、同時に必要な箇所での「レスポンスの早さ」を意識しながら作業を遂行しております。\r\n\r\nまた、人当たりの良さとコミュニケーション能力を活かして、円滑なやりとりを行い相手の懐に入り込むことができます。\r\n\r\n新たな知識や触れたことのない技術への興味・関心を常に持っており、積極的な習得に努めながら業務に従事して参ります。\r\n\r\n自身の体調面においては常に配慮を行なっており、体調不良による業務遅延を発生させることはございません。',NULL,4,'2022-07-26 21:48:27',NULL,'2023-06-01 09:09:33',111),(73,'名字','名前','ミョウジ','ナマエ','N.M','19990217',0,'一之江','1','1',NULL,NULL,'私は、1年間、ECサイトの運用保守・開発業務に従事してきました。\r\n開発業務では、主に、ASTERIA Warpというノーコードツールを用いて開発を行っておりました。開発時には、取引先やメンバーと密にコミュニケーションをとることで、\r\n当初の計画からずれることなく、プロジェクトを円滑に進めることができました。\r\n運用保守業務では、障害発生時に、迅速でかつ正確な対応や問題解決能力が求める為、\r\n臨機応変に対応する力や問題解決能力が身についたと思っております。\r\nこうした経験を活かして、今後も開発業務に従事し、プロジェクトを円滑に進めていきたいと思っております。',NULL,4,'2022-07-26 21:51:00',NULL,'2022-09-07 03:47:59',114),(74,'名字','名前','ミョウジ','ナマエ','N.M','19980803',0,'東雲','1','1',NULL,NULL,'設計・開発・運用・保守を一貫してやってきました。\r\n今後も運用保守で培った知見を活かしてユーザー視点に立った業務を行なっていきたいです。\r\n\r\n過去に対応した案件の例\r\n・Laravelで管理サイト全体の新規構築\r\n・FuelPHPで管理サイトの新規画面の追加\r\n・Goでメール通知機能の改修\r\n・GoでAPIの開発\r\n・Datadogの機能をTerraformで新規に管理する\r\n・AWSのリソースをTerraformで新規に管理\r\n・Datadogの導入対応\r\n・運用、保守\r\n　・Datadogを用いて不具合の原因調査と修正対応\r\n　・プロダクトに関する問い合わせ対応\r\n・その他',NULL,4,'2022-07-26 21:52:22',NULL,'2022-09-07 03:48:05',114),(75,'名字','名前','ミョウジ','ナマエ','N.M','19880920',0,'南桜井','2','5','2024','06','常に新たな知識や技術を勉強し続け、能動的・積極的に業務に従事することを心掛けております。\r\n自己研鑽の為にも勉強だけでなく、業務においても幅広く携わっていきたいと考えております。\r\n常に興味を持ち続け、自ら学習を続けながら所属するチームに貢献できるよう「スピード」と「正確性」を念頭に業務に望みます。',NULL,0,'2022-07-26 21:54:03',NULL,'2024-04-02 00:49:08',1),(76,'名字','名前','ミョウジ','ナマエ','N.M','19990820',0,'西荻窪','0','7','2023','03','初めてのことでも、しっかりと理解して進むことを意識して日々精進しています。また、自己管理を徹底することで日々の業務のパフォーマンスを最大限発揮できるように心がけています。経験の乏しい技術についても努力を重ね、上流から下流工程まですべてを任せていただけるエンジニアを目指します。よろしくお願い致します。',NULL,4,'2022-07-26 21:56:13',NULL,'2023-03-31 06:25:06',1),(77,'名字','名前','ミョウジ','ナマエ','N.M','19980506',0,'葛西','2','1','2022','09','2020年7月にメンバーとして現在の現場へアサインされ、2021年7月にはリーダーに着任し、現在まで2名のメンバーを率いての業務を行っております。リーダー着任当初、管理が行き届いておらず肥大化していた管理工数を見直し余分な工数を削減した実績があり、マネジメント方面に強みを持っております。現在の業務としてはAsteriaというノーコードのAPI開発やJP1というジョブ管理システムの運用保守業務を主に担当しております。',NULL,0,'2022-07-26 21:58:22',NULL,'2023-03-31 06:25:21',1),(78,'名字','名前','ミョウジ','ナマエ','N.M','19880710',0,'吉川','7','0',NULL,NULL,'基本的なインフラ、システム構築知識を持ち合わせており、１人でシステム構築できる技術力があります。\r\nインフラはオンプレミスのみならず、クラウドも対応できます。システム開発は可能な限り汎用性、表示・処理速度、高可用性が高いことや、インフラのオートメーション化にも取り組んでおります。\r\nまた、課題に対する姿勢を崩すことなく真摯に努めることを旨とし、日々業務に励んでおります。不明な点に対しても投げだすことなくやり遂げる実績と、前向きさをもって業務にあたるよう心がけております。',NULL,1,'2022-07-26 22:45:45',NULL,'2023-10-04 08:03:14',78),(79,'名字','名前','ミョウジ','ナマエ','N.M','19950716',1,'小倉台','5','1','2022','09','私はフロント側とバック側、両方できるWEBエンジニアを目指しています。\r\nそれを達成するため、現在はフロント側の業務を一通りこなせるようになることを目標に行動しています。\r\n間違いや遅れが発生しないように、積極的に疑問点を調べたり質問をするように常に心掛け業務にあたっています。',NULL,4,'2022-07-26 22:46:53',NULL,'2023-07-05 01:04:27',79),(80,'名字','名前','ミョウジ','ナマエ','N.M','19980713',1,'甲州街道',NULL,NULL,NULL,NULL,'■自己 PR\r\n●プロジェクトのスケジュールに応じた進捗管理とコミュニケーション力\r\nSES として現場に常駐しプロジェクトを 2 個経験しております。運用・保守から、パッケージシステムを使用 した開発を行いました。業務で身についたことは、開発メンバーとの進捗確認、自分の毎日のタスク管理を常 に行うように意識した事です。スケジュールに大幅な遅延が出ないようにできるだけコミュニケーションをとり、 自身のタスクとスケジュールで遅延を出ないように努めてまいりました。 プロジェクト自体の遅延が出た場合に自分だけでは解決しきれなかったこともありましたが、開発メンバーと改善案を 考え、できる作業を先手に進めて参りました。',NULL,4,'2022-07-26 22:49:25',NULL,'2023-03-31 06:27:30',1),(81,'名字','名前','ミョウジ','ナマエ','N.M','19941219',0,'光が丘',NULL,'4',NULL,NULL,'Biz業務において10名程度、30名程度、100名以上の組織のマネジメント経験あり。',NULL,NULL,'2022-07-26 22:50:43',NULL,'2022-09-07 03:49:37',114),(82,'名字','名前','ミョウジ','ナマエ','N.M','19980515',0,'京王線国領駅','3','7',NULL,NULL,'・大学にて統計について４年間学習をしています。言語としては、R、Pythonです。  \r\n・コロナ期間に大学DX向上のため大学内でのclosedSNS開発を行いました。\r\n・リモート授業環境を上げるために、私専用Webアプリケーションの開発を行いました。\r\n・学生時代社内開発宣伝のための動画作成を行い、YoutubeやInstagramへの投稿を行なっていました。\r\n・研修内で行われたチーム開発では、リーダーを行い、環境構築、レビュー、ドキュメント作成、進捗管理等を行いました。\r\n・タスクに対して、全力で取り組み納期厳守で行います。\r