。また、チームビルディング研修をする際に納期ギリギリではなく、自分の作った環境で他のメンバーが作ったソースコードを問題なく載せられるように、納期に余裕を持って環境を構築しました。\r\n研修を通して、環境構築やコマンドを叩いてシステムを動かすことに楽しさややりがいを感じたので、より大きなシステムや現場で使用されている環境に触れてみたいと思いました。ゆくゆくはリードできる立場に立って、色んな環境を構築していきたいです。よろしくお願いいたします。',NULL,4,'2022-07-26 23:45:47',NULL,'2023-04-20 01:40:36',103),(104,'名字','名前','ミョウジ','ナマエ','N.M','19910109',1,'学芸大学','4','3',NULL,NULL,'Azureを活用した自動化・セキュリティ強化業務に携わってきました。\r\n2022年4月からはプロジェクトリーダーとして、チームの管理や顧客への提案を行っております。\r\nAzureセキュリティ領域を中心にスキルを身につけながら、マネジメント経験を積むことで\r\n顧客にベストな提案ができ、且つ実行力のあるエンジニアとして成長していきたいです。',NULL,0,'2022-07-26 23:52:13',NULL,'2023-02-27 07:28:46',104),(105,'名字','名前','ミョウジ','ナマエ','N.M','19950917',0,'JR 下総中山','4','2','2023','10','体調管理には自信があり体力があり風邪をひいて業務を滞らせることはありません。\r\n業務において、受動的ではなく、能動的・積極的に従事することを心掛けております。\r\nリーダーの経験もあり、メンバーのタスク管理・稼働状況の管理・体調の管理など広い視野でチームをまとめた実績があります。\r\n納期は厳守し、予期せぬトラブルでスケジュール通りに進まない兆候があった場合には、早めに関係者との連絡を取って調整を行ったり、スケジュール通りに進められることができる代替案を共有したり、迅速な対応を行ってきました。',NULL,0,'2022-07-26 23:54:27',NULL,'2023-10-23 12:16:06',1),(106,'名字','名前','ミョウジ','ナマエ','N.M','19960531',0,'近鉄長瀬','2','3','2024','01','実務開始前は1年程python（Django）, Vue.js などを自己学習し、個人でサブスクリプション形式のECサイトを開発・運営しておりました。ゼロベースでシステムを作る事に関しても経験がございます。\r\n\r\n2022年12月〜2023年9月までラボチームメンバーとして、Go, php, javaなどの言語を使い、バックエンドの開発を経験しています。\r\n成果型ラボのため、毎月決まった成果を出す必要があり、サブリーダーとして自分や他のメンバーの進捗を管理するなど、マネジメント面でも決まった成果を達成するよう貢献しておりました。\r\nキャッチアップの速さには自信があり、新卒や開発経験の薄い人をフォローしていました。\r\n\r\n2022年10月〜現在に関してはSESにて常駐しており、主にJavaをメインで開発しております。\r\n基本設計のフェーズからリリースまでは経験しており、現在の案件ではプロジェクトのリーダーとしてエンドとの打ち合わせ、工程の作成（工数計算）仕様書レビュー、ソースコードレビューになどの業務行いつつ、案件をテックリードしている立場でもあります。',NULL,0,'2022-07-27 00:01:33',NULL,'2024-04-02 01:08:05',1),(107,'名字','名前','ミョウジ','ナマエ','N.M','19980725',0,'JR志紀','3','4','2023','07','前職ではありますが、１年半ほどメインでオンプレサーバーの構築を主に担当しており、基本設計～設置までを一貫して行った事も数回ですが経験済みです。主にNEC製のサーバーに触れている事が多かったです。\r\n現在はAzure Portalを使用しその中の多彩なサービスを使用し、お客様からの依頼を請け業務を行っています。\r\n下記はAzure Portalで使用しているサービス一覧です。\r\n・App Service\r\n・Azure Active Directory\r\n・リソースグループ\r\n・Network Security Group',NULL,4,'2022-07-27 00:02:3