を見ながら、独学してきました。それでも短時間でHTML、CSS、JavaScript、PHP、データベースをなどを入門し運用できるレベルに達しました。この度、貴社の求人情報を知り、ぜひ貴社の事業に貢献したいと考え、応募した次第です。',NULL,4,'2022-09-29 08:02:44',NULL,'2023-01-19 06:07:04',1),(118,'名字','名前','ミョウジ','ナマエ','N.M','19990125',0,'福島','0','8','2022','11','2022年11月からエンジニア未経験として現職に入社し、主にWEBアプリケーションの案件に従事しております。\r\nWEB系において、業務でAngularJS、TypeScript、Java(Servlet/JSP)を使用しました。\r\n未経験ではありましたが、多くのソースを読む機会をいただき、また様々な種類の業務内容に触れ、\r\n今までの案件も1人で開発も任せていただいていたので、PGレベルの開発であればお役に立てるかと考えております。\r\n\r\n業務経験は短いですが、自己学習として案件で使用する言語、技術を使いアプリケーションを作る等して、\r\n積極的にキャッチアップを行っています。\r\nそのため、不足している知識・技術があっても、素早くキャッチアップし、貢献できるかと考えています。\r\n\r\nまた、新しい技術も積極的に学んでおり、案件に関わらず、ReactやDocker等のモダンな技術も、\r\n自己学習として触れております。',NULL,4,'2022-09-29 08:04:26',NULL,'2023-06-28 08:24:40',108),(119,'名字','名前','ミョウジ','ナマエ','N.M','19941001',0,'八千代台','2','7','2022','11','自身の強みは創意工夫を凝らすことです。\r\n業務での失敗をそのままにせず、ドキュメント等を作成し業務の改善を図っています。\r\n前職では案件管理アプリを作成し生産性を倍近く伸ばしました。\r\n直近のプロジェクトでは課題管理表を納期を遅らせたことはありません。',NULL,4,'2022-10-07 05:28:05',NULL,'2023-07-05 03:43:48',119),(120,'名字','名前','ミョウジ','ナマエ','N.M','19950410',1,'阪急バス 利倉西','0','0','2023','01','■常に目標を持ち、目標達成に向かって努力することを惜しみません。\r\n　私は大学生の時に全額無償の留学プログラムを使い留学するために、試験で\r\n決められた以上の点数を取得しました。\r\n　また、社会人になってからは就職先で必要となった国家資格（航空無線通信士）\r\nに合格することを目標とし、努力を惜しまず行動してきました。\r\n　どちらも一度目で合格する事は出来なかったため、しっかりと対策を考え\r\n諦めず行動したことにより、合格という目標を達成することが出来ました。\r\n　その経験から貴社に入社後も、キャリアアップの度に具体的な目標を持ち続け、\r\n努力を惜しまず自分を高めながら目標達成のために行動していきます。\r\n　\r\n■リーダーとしての役割を任せられることが多く、その責任を全うすることができます。\r\n　大学時代・社会人時代に短期で経験したアルバイトにおいては15～40名の\r\n　リーダー又はそれに準ずる任務を与えられ、どちらもその役割を全うしました。\r\n　チームには年齢や立場の違う方々がいらっしゃったため苦労もありましたが、\r\n　それぞれの方への言葉遣い・伝え方などに気を配りながらまとめることができました。\r\n　貴社においてもリーダーシップの経験を活かし、将来的にチームをまとめる際には\r\n　メンバーへの気配りを大切にできるリーダーとなれるよう努めてまいります。　　\r\n\r\n■責任感が強く、時間管理・安全管理を徹底しながら与えられた責務を果たします。\r\n　リーダー以外の業務においても、与えられた仕事はきちんと自分の責務と認識し\r\n　その役割を果たすことができます。物事を「他責」ではなく「自責」でとらえることが\r\nでき、タスクの大小関わらず、責任をもって取り組むことができます。\r\n　また、航空業界で仕事をしていたこともあり、時間管理・安全管理を徹底していました。\r\n貴社においてもこれまで身につけた時間管理・安全管理の感覚を活かしながら、\r\n任せていただいた仕事の責任をしっかりと果たし\r\n貴社の発展に貢献していけるよう努めてまいります。',NULL,NULL,'2022-10-24 00:58:21',NULL,'2022-10-25 02:52:21',120),(125,'名字','名前','ミョウジ','ナマエ','N.M','19960823',0,'新京成線・薬園台駅','1','8',NULL,NULL,'SEとして約2年経験を積んで天職だと自負しております。\r\n私はSEとして最も重要な要素は「顧客との信頼関係」だと考えております。\r\n信頼関係を築くために「問題意識・責任感・技術力」の3つの軸を自分は大切にし、培って参りました。\r\n\r\n業務でこの3つの軸を意識し、取り組みが成功した例がありました。\r\n業務効率を上げるシステムを構成するために、顧客の要件を細部まで確認し、軽微な修正でも他所への影響や運用時の問題などを常に考え取り組みました。\r\n結果的にチーム全体の作業効率を上げることに成功し、今までできなかった作業ができるようになり、時間も有効活用できるようになりました。\r\n\r\n今後も顧客と信頼関係を強固に結びエンジニアとして確かな技術を提供し、\r\nより多くの良質なサービスを提供できるよう取り組んで参ります。',NULL,4,'2022-12-05 04:46:34',NULL,'2023-02-27 08:22:45',125),(126,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-12-05 04:59:16',NULL,'2022-12-05 04:59:16',NULL),(127,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-12-05 05:04:49',NULL,'2022-12-05 05:04:49',NULL),(128,'名字','名前','ミョウジ','ナマエ','N.M','19950224',0,'長岡京','1',NULL,'2024','02','IT業界に携わって1年になりますが、経験として基本設計～結合試験までを担当しました。\r\njava、javascriptに関しては1年で自走できるようになりました。\r\nまた、社会人経験も長い為、エンドや取引先との会話なども問題なくこなすことができます。\r\n未経験の言語でも時間をかけしっかりとキャッチアップしていく能力があると自負しています。',NULL,4,'2023-01-12 11:51:48',NULL,'2024-02-09 08:00:06',128),(129,'名字','名前','ミョウジ','ナマエ','N.M','19880714',0,'京王堀之内','1','3','2023','05','JavaとSQLに関してyoutube、udemyの動画で学習を行ったり、progateでコーディングを行い、日々自己研鑽に励んでおります。これまでプログラミングスクールで学んだ経験があり、HTMLやCSS、javascript、PHP、SQLの学習を行いました。また、実務ではHTMLやCSS、javascriptを用いたり、wordpressのカスタマイズをするためにPHPを利用し、web制作を行なった経験があります。現在はJavaの案件に参画しており、サイト構築の手順書やDBの手順書を作成する業務に従事しております。',NULL,4,'2023-03-27 06:09:43',NULL,'2023-03-27 14:15:41',129),(130,'名字','名前','ミョウジ','ナマエ','N.M','19970606',0,'江北','0','3','2023','10','根性と円滑なコミュニケーション能力を持っていることが自己PRの大きなアピールポイントです。\r\n常に真摯な姿勢で業務に取り組み、周囲と円滑なコミュニケーションを取ることで、チームのモチベーションを高めることができます。\r\n\r\nまた、新しい技術と知識にも熱心に取り組んでいます。\r\n技術力だけでなく、コミュニケーション能力も重視し、プロジェクトを成功に導くために努力しています。\r\n\r\n私は技術力において至らない点があるかもしれませんが、\r\nその分チームに貢献できるように、努力しています。\r\n常に前向きな姿勢で、課題を解決するために最善を尽くします。',NULL,NULL,'2023-04-17 06:47:14',NULL,'2023-08-25 02:4