の勉強により、英語力を高めるための基礎をしっかりと築きました。読み書きだけでなく、リスニングやスピーキングのスキルも磨いてきました。英語でのコミュニケーションにおいても自信を持って対応できると自負しています。\r\n\r\n現在は、研修プログラムに参加しています。この研修では、基礎的なITスキルから応用的なスキルまで幅広く学ぶ機会が与えられています。研修を通じて、プログラミング言語やデータベースの知識を習得し、システム開発やデータ解析などの業務において有用なスキルを身につけています。\r\n\r\n私はIT業界への情熱と向上心を持ち、新しい技術やトレンドについて常に情報を収集しています。また、問題解決能力や論理的思考力も備えており、複雑な課題に対しても的確な解決策を見つけることができます。\r\n\r\n新卒としての私の強みは、柔軟性や新たな視点を持ちながら取り組む姿勢です。未経験者としての新鮮な視点を活かし、学んだ知識とスキルを活用して、会社の成長に貢献したいと考えています。新たな環境でのチャレンジを心待ちにしています。',NULL,NULL,'2023-05-15 06:46:28',NULL,'2023-05-31 00:43:23',143),(144,'名字','名前','ミョウジ','ナマエ','N.M','19940309',0,'駒込','0','0','2023','07','2023年4月からIT業界に入り、現在までにインフラ(LAMP環境構築・MySQL)・PHP・Javaの研修を受けました。また、チーム研修でコーポレートサイトの作成を行いました。\r\n\r\n入社までは別分野ですが博士号を取っており、自己学習や作業計画の立案、プレゼンテーション、ドキュメント作成、小規模なチームの運営などは得意です。\r\n\r\n性格はポジティブ・楽観的で、新しい知識や技術を取り入れるのが好きです。\r\n\r\nよろしくお願いいたします。',NULL,NULL,'2023-05-15 06:52:05',NULL,'2023-05-30 06:11:02',144),(145,'名字','名前','ミョウジ','ナマエ','N.M','19980429',0,'中神','0','9','2024','05','私の強みは好奇心が高く、学びに積極的であるところです。\r\n\r\n出来たからそれで終わりではなく、さらに問いを繰り返しできるだけ本質に近づこうという姿勢で学んでいます。\r\n\r\n具体例として、httpに関する本を読んでも実感をもって理解できなかったので、簡易的なhttpサーバーをスクラッチから開発しました。',NULL,NULL,'2023-05-15 06:53:22',NULL,'2024-03-05 05:09:09',145),(146,'名字','名前','ミョウジ','ナマエ','N.M','19990712',0,'大塚','0','7','2023','07','【長所】\r\n・好奇心が旺盛　・環境変化に柔軟　・挑戦好き\r\n---\r\n自分は好奇心が旺盛で、調べる事や追求することは得意です。\r\nなので、新しい言語や環境に対して抵抗感なく順応することができます。\r\nまた挑戦することが好きなので、日々行動して多くの経験を得る事を\r\n意識しています。\r\n\r\n【重視していること】\r\nチームでの協力やコミュニケーションを\r\n大切にすることを重視しています。\r\nそのため、素早く変化する環境での作業にも適応し\r\n質の良いアウトプットをし、貢献できる自身があります。',NULL,NULL,'2023-05-15 06:54:22',NULL,'2024-02-28 05:55:44',146),(147,'名字','名前','ミョウジ','ナマエ','N.M','19991216',1,'東二見','0','7','2023','07','実務開始前は自己学習としてRubyonRailsにてアプリ開発を行い、フロント周りは一通り独学で学びました。その後未経験で入社し、入社後は3か月の研修でPHP, java, MySQLを学びました。\r\n\r\n実務ではJavaのマイグレーション案件に参画致し、フロント周りの障害対応を一任させていただきました。\r\n現在はJava, Reactの自己学習を進めております。\r\n\r\nコミュニケーション能力には自信があり、とりわけレスポンスの速さには人一倍気を付けて行動しているため、迅速な対応力で業務に取り組むことができます。\r\nこれらの長所を活かし、色々な仕事に向上心を持って前向きに取り組むことができます。\