'19950102',0,'鮫洲','2','6','2024','05','■挑戦と適応の精神\r\n私の強みは新しいチャレンジに積極的に取り組むマインドと、それを可能にするための適応力です。飲食業からエンジニアへの道を切り開く過程で、必要な知識とスキルを効率的に習得し、現場で活用するまでに至りました。この経験は、新たな技術や業務に迅速に適応し、成果を出す能力を証明しています。\r\n\r\n■自己成長への意欲\r\n私の学習意欲は非常に強く、業務外の時間も積極的に自己学習に取り組んでいます。例えば、Nuxt.jsを初めて使う事になった際、参考書や公式ドキュメントを見ながら自己学習し、業務外の時間を活用して2週間で簡単な機能追加であれば1人で実装できるレベルまでキャッチアップすることができました。このように、新しい技術の習得や知識の増強に努め、それを業務に活かすことでプロジェクトの品質向上や開発効率の改善に貢献しています。\r\n\r\n■フィードバックを活かした成長\r\n私の持つ素直さと、他人の意見を反省点として受け入れる能力もまた、私の強みです。コードレビューでのフィードバックは改善の機会と捉え、それを積極的に取り入れてきました。このような姿勢により、詳細設計からコーディング、結合テストまでと幅広く担当する能力を身につけ、更なる技術力の向上を達成しています。\r\n\r\n現在は、開発チームの一員として自身のスキルを活用しつつ、半年後を目処に要件定義にも携われるよう、常にスキルアップを図っています。私の熱意と経験を活かし、貴社のプロジェクトに貢献できればと思います。',NULL,4,'2023-06-30 07:57:57',NULL,'2024-04-02 00:51:20',1),(154,'名字','名前','ミョウジ','ナマエ','N.M','19970409',0,'JR中央線武蔵小金井','2','1','2023','10','①資格取得に積極的に取り組んでおり、現在は自分のネットワークやサーバー等に関する知識が不足している事に気づき、CCNAやlinuCレベル2の資格取得に向けて勉強しています。\r\n②私は行動力があり、問題に主体的に取り組み成果を上げることが得意です。新しいプロジェクトが立ち上がると、チームに貢献できるように積極的にアイデアを出し合い、計画を立てることが得意です。柔軟な発想とチームワークを大切にし、新たな挑戦を恐れません。',NULL,NULL,'2023-07-18 03:55:26',NULL,'2023-10-27 01:19:26',1),(155,'名字','名前','ミョウジ','ナマエ','N.M','19900213',0,'鴨宮','9','3','2023','09','インフラエンジニアとして金融系、公共系、通信系等のシステムの仮想化基盤リプレイスの設計・構築・運用を約6年経験しております。\r\nその後WEB開発分野へスキルチェンジし、WordPressを使用したサイト制作からPHPフレームワーク（Laravel等）を使用したアプリケーション\r\n開発にも携わって参りました。\r\nまた、チームリーダーやディレクションの経験もあり、顧客折衝からチーム開発まで広い視点で柔軟に進められることが強みです。\r\n直近はバックエンド開発スキルを上げるためプログラマーとして参画しております。',NULL,0,'2023-07-18 08:28:01',NULL,'2024-03-21 00:54:43',1),(156,'名字','名前','ミョウジ','ナマエ','N.M','19951029',0,'北綾瀬','1','2',NULL,NULL,'エンジニアとしてのキャリアをスタートさせた頃は、プログラムの基礎から学び直す必要がありました。そのため、日々自身の課題を抽出し課題に対しての学習を行っていました。それが、今後の仕事において非常に役立ったと感じています。また、開発プロジェクトにおいても、タスクを分割し、短期的な目標を設定しながら、コツコツと進めていくことが重要だと考えています。そのために、プロジェクトのスケジュール管理や、タスクの見積もりに力を入れ、効率的に進めることができるように努めています。',NULL,NULL,'2023-07-19 01:30:04',NULL,'2023-07-26 02:12:45',156),(157,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2023-07-24 09:36:23',NULL,'2024-04-02 00:57:06',1),(158,'名字','名前','ミョウジ','ナマエ','N.M','19881220',0,'西武新宿線狭山市','0','6','2023','09','前職で航空自衛官として１５年勤務しておりました。そこで１０名の部下を持つリーダーとしてマネージメントの経験があります。さらにマネージメントでの褒賞を受賞、グアムへの国外出張も経験しております。法令遵守、ハラスメント及びセキュリティに対するリテラシーは自衛官時代に身に付けております。視野の広さは人一倍自信があります。\r\nエンジニアとしての最初の現場ではマネージャーの補佐としてタスクのスケジュールをWBSを使用してプロジェクトの推進に携わらせていただきました。最初の現場では基本設計〜製造のウォーターフォール開発に関わらせていただきました。直近の現場ではスクラム開発でした。どちらの現場も製造メンバーとして参画させていただいておりました。\r\nエンジニアとして技術力を上げるために平日２時間、休日８時間を目安に技術学習しております。学習方法は、技術書籍、Udemy、Youtube、ブログ、Qiita及びDiscordにおける他のエンジニアとの知識共有などを中心にしており、アウトプットとしてポートフォリオ作成及び最近始めたQiitaの記事投稿をしております。学習により身に付けた技術をプロジェクトにおいて発揮していきたいと考えております。技術情報等のキャッチアップ力は高いと自負しております。\r\n自衛隊での経験とエンジニアとしての知識・技術を融合させ、課題を解決し、新たな成果を生み出すことに情熱を燃やしています。柔軟性と協調性を持ち合わせ、チームメンバーやクライアントとの円滑なコミュニケーションに努めます。皆さんのチームに貢献し、共に成長できる機会を楽しみにしています。',NULL,4,'2023-07-25 02:42:11',NULL,'2024-04-02 00:50:58',1),(159,'名字','名前','ミョウジ','ナマエ','N.M','19960813',0,'東海道本線 (JR東日本)　国府津','4','3','2023','10','前職では主にゲームタイトルの運用・機能改修および社内共通システムの機能開発を担当しておりました。\r\nまずゲームタイトルの運用・機能改修ですが、前職の企画セクションから上げられた新規機能の開発について、プロジェクトリーダの指示のもと詳細設計、開発、およびデバッグ時に報告されたバグの修正を行ったり、既知の不具合の修正を行ったりしていました。タイトルをプレイしてくださっているお客様からのお問い合わせの調査も平行して行っておりました。\r\n社内共通システムも利用者がお客様から社内利用者に変わったのみで、似たようなことを担当しておりました。\r\n\r\n他セクションとの密なコミュニケーションを行う環境での開発経験は、案件参画にあたって非常に活用できるものと考えております。',NULL,4,'2023-07-28 01:12:28',NULL,'2024-04-02 00:49:52',1),(160,'名字','名前','ミョウジ','ナマエ','N.M','19970523',0,'東武東上線　ふじみ野','3','7','2024','05','3年半システムエンジニアとして従事してきました。作業に課題が発生した際には、初めに作業対象の現状と目的を明確にし、目的を実現するためにどのようなプロセスが有効であるか複数案を考えた上で、QCDの観点から最も適切だと判断した案を採用して進めるように意識をして参りました。ITの現場では日常的に課題が発生するため、業務を通して問解決能力が身に付きました。\r\nまた、SEとして、秘匿性が高く、セキュリティが厳重な職場でシステムの開発を行ってきました。一つの失敗がのちに大事になってしまうような重大な業務を通じて、不具合や改善できる箇所はないか等、物事に対して第三者の視点から思考するように意識し、取り組む力、調査する力を習得することができました。\r\n今もこれらを意識して日々業務に取り組んでおります。',NULL,4,'2023-07-31 11:59:02',NULL,'2024-03-22 00:50:13',160),(161,'名字','名前','ミョウジ','ナマエ','N.M','19980425',0,'海の公園柴口','3','0','2023','10','これまでC#をメインに経験を積んできました。\r\n前職入社時の研修や半導体製造装置向け通信IFの開発時では、上司から技術力を認められ、早い段階からメンバーのコードレビューを行っておりました。\r\nコードレビューでは、仕様を満たしているか、条件式に二重の否定が入っていないか、変数のスコープが適切か、などの観点から実装内容を確認いたしました。\r\nまた、半導体膜厚測定装置向け通信IFの複数機種対応時には、リグレッションテストの工数増加を懸念し、自らMSTestによる単体テストの自動化を提案いたしました。\r\nこれからは趣味のゲーム開発で身につけた学習習慣を活かし、新しい技術に取り組んでいきたいです。',NULL,4,'2023-08-02 00:32:48',NULL,'2023-11-02 05:20:34',1),(162,'名字','名前','ミョウジ','ナマエ','N.M','19871227',0,'六町','1','3','2023','09','■ 幅広い技術・サービスの追求による積極的な向上心\r\n    業務で関わった技術・サービスに限らず、常に新しい技術やサービスへの興味を抱き、業務内外問わずキャッチ・アップを行っています。\r\n    最近では、Python のライブラリである \"deepface（https://github.com/serengil/deepface）\" を通じて、画像認識に興味を抱きました。また、効果的な自己管理に役立つツールである \"Notion（https://www.notion.so）\" を活用し、業務内外の効率を向上させる方法にも取り組んでいます。\r\n    これにより、常に最新のトレンドや技術・サービスにアンテナを張り、幅広い知識と技術やサービスのキャッチ・アップを行っています。\r\n    ────────────────────\r\n■ 多様なコミュニケーション力と共感性\r\n    前々職での小売（販売）業における経験を通して、人種，国籍，年齢，性別に関係なく、多様な人々とのコミュニケーションを培っていました。\r\n    これにより、効率的な情報共有を促進し、組織の知識の底上げに貢献できると感じています。',NULL,NULL,'2023-08-04 02:45:49',NULL,'2023-08-14 19:28:20',162),(163,'名字','名前','ミョウジ','ナマエ','N.M','19971112',0,'南柏','2','3','2024','06','前職では主に生活保護システムの運用保守を行い、SQLを用いたDBの操作や運用で使うツール（バッチファイル）の作成・修正をしていました。また前職期間中に業務と並行して資格も取得することができました。\r\n社内研修ではフロント言語（HTML/CSS/JavaScript）から、Java/SpringBoot、Webサーバー構築まで幅広く学習しました。\r\nまた独学でPython/Django、PHP/Laravelを学習していました。\r\n\r\n現在は、プログラミング学習サイトにスカウト（ダイレクトリクルート）機能を追加する案件に参画しております。\r\n主にバックエンド（Python/FastAPI）を担当しており、初案件だったのですが、設計からリリースまで一貫して対応することができました。\r\n\r\n常に向上心を強く持ち、現場経験を通じて設計や読みやすいコーディング、マネージメントの知識など開発にかかわる多くのことを吸収したいと考えています。\r\n研修中は自主的に進捗状況を考えながら課題を進めることで、予定よりも早く進めることができ、追加の課題も達成することが出来ました。\r\nまた、今後の業務を円滑に進めるべく、ビジネススキルやコミュニケーションの学習も行いました。\r\nいち早く業務内容を吸収し、能動的・積極的に従事することを心掛けていきたいと思っています。',NULL,NULL,'2023-08-18 01:05:13',NULL,'2024-04-02 00:49:36',1),(164,'名字','名前','ミョウジ','ナマエ','N.M','19900708',0,'東急電鉄東横線  反町','1','6','2023','11','▼円滑な業務遂行 \r\n　円滑な業務遂行のため、積極的な情報共有やスケジュール把握・共有を意識しながら業務を遂行してきました。 （メンバー１人の進捗管理を行っていました。）今後のスケジュールで不安な点を予め確認し、場合によってはメンバーのタスク切り出し支援や、納期が厳しい場合は顧客と通話を行い温度感を確認しながら折衝を行っております。\r\n　そして、突発的な休みなどに備えて、手順の必要な物は手順書を作成するようにしています。ServiceNowでチケット管理を行っているため、更新をこまめに行って情報共有を多く行うようにしております。対応履歴をServiceNowに集約することで、類似事象が発生した際に誰でも対応できるようにするためです。\r\n\r\n▼新規技術の習得 \r\n　業務で必要な技術については動画教材（Udemy）や書籍を購入し、効率的な業務遂行に努めております。また、資格を取得した際は自社社員に取得ノウハウを展開する勉強会を開いております。最近は、情報セキュリティマネジメント試験の資格取得ノウハウを勉強会で展開し、現在2名が合格しております。勉強会参加者からは「私でも簡単に取れることがわかりました！」という感想を直接頂いております。\r\n \r\n▼最後に  \r\n今後はクラウドの利点を活用したアーキテクトを目指しております。これまで培ったシステム運用経験を活かしつつ、積極的に学習して参りますので何卒宜しくお願い致します。',NULL,0,'2023-08-21 00:44:02',NULL,'2023-11-01 04:59:57',1),(165,'名字','名前','ミョウジ','ナマエ','N.M','19980426',1,'下井草','0','0','2023','11','飲食店での約６年間のアルバイト経験から、コミュニケーション能力が自分の強みです。\r\n飲食店での業務は、店舗数が多く、人の出入りが激しくコミュニケーションが希薄な状況だった為、\r\n個人の小さなミスが上手く伝達されず、後々大きな問題に発展することが多々ありました。\r\n\r\nそこで私はスタッフ同士が気兼ねなく報連相できる環境を整えるため、所属店舗関係なく積極的に会話することを意識して業務を行いました。その結果どのメンバーとも些細な疑問や不安点でも気軽に相談しあえる雰囲気を作ることができ、伝達不足による大きなミスもなくすことができました。\r\nミスが発生しない様に黙々と集中して業務にあたることも大事ですが、適度なコミュニケーションは業務を円滑に進めるために必須だと考えております。ここで経験したことはどの現場でも活かせるものと考えております。\r\n\r\n研修中は、「反復学習による知識の定着」、「学習後は言語化可能かという基準で現時点での定着度を理解すること」、「不明点を明確すること」の３点を意識して取り組んでおりました。\r\n隙間時間にはIT関連の動画視聴や参考書を読む時間に充てることで、学習を習慣化させることができました。\r\nこれからも、常に自ら学んでいく姿勢を武器に、技術に関する知識やスキルを磨き続け、戦力になるべく努力し続けます。',NULL,NULL,'2023-08-21 06:19:57',NULL,'2024-04-02 00:50:39',1),(166,'名字','名前','ミョウジ','ナマエ','N.M','19970215',0,'戸越','0','7','2024','07','調理師として7年間携わってきました。\r\n長年の調理師としての経験から培ったコミュニケーション能力や瞬発的な対応力・適応力をエンジニアとしての新たな舞台で活せるよう現場で必要な技術を学習しています。\r\n\r\n調理現場での経験は、圧倒的な瞬発力が求められる状況だった為、「適切な判断力」と「即座の対応力」といったスキルを身につけることができました。この経験とスキルは、今後のプロジェクトの進行中に生じる課題にも、変化する状況にも柔軟に対応するための大きなアセットとなると信じています。\r\n\r\n経験させていただいたプロジェクトとして、業務システムの開発を基本・詳細設計書作成の段階から参画し、フロントエンド（React.js）、バックエンド（Laravel/Inertia.js）、DB（MySQL）、環境（Docker/Vagrant）を用いて開発いたしました。\r\n\r\n開発エンジニアとして学ぶことはまだまだ山積みですが、新しい知識に対する好奇心と貪欲さを忘れずに、日々成長できるよう学習を続けています。私は生まれてから19年間カナダで生活していた経験を持っており、その間に養った英語力を活かし、日本語のリソースだけではなく、英語の教材も利用し、多角的な視点から学びを進めております。',NULL,NULL,'2023-08-21 06:29:46',NULL,'2024-04-08 01:22:07',58),(167,'名字','名前','ミョウジ','ナマエ','N.M','20000420',0,'川口元郷',NULL,'7','2024','07','学生時代は茨城県県北振興プロジェクトの代表を務め、チームをまとめるマネジメントスキル、\r\n牽引するリーダーシップスキルを培って参りました。\r\n\r\n現在は個人で国際交流、インターネット間交流を目的とした平均年齢26歳・140名以上のメンバーからなるグループの活動・運営を行っており、多種多様なメンバーとの交流を通じ、コミュニケーションスキルを常に磨き続けています。\r\n\r\n研修期間は「分からないことを分からないままにしておかない」を常に意識し、\r\nその日分からなかったことは、その日のうちに解決するよう行動して参りました。\r\n\r\n現在までも請負案件で設計からテストまで幅広く経験を積みながらも、コミュニケーションを取りながらチームで進めることを基本に置いた動きで活躍してまいります。',NULL,NULL,'2023-08-31 00:51:23',NULL,'2024-04-04 00:50:01',167),(168,'名字','名前','ミョウジ','ナマエ','N.M','19930421',0,'菊川','3','9','2024','04','2020年/4月~2023年/6月\r\n前職ではWeb制作部門を新規に立ち上げし、つけ麺屋のECサイトを制作しました。\r\nまたサイトの運営・SEO対策にも携わらせて頂き、検索順位で「つけ麺 EC」で１位、「つけ麺 通販」で12位を達成。\r\n\r\n2023年/11月~2024年/3月\r\n法人口座開設案件に参画し、Java開発と単体試験、結合試験のテストを経験。\r\n\r\n自己研鑽\r\nReactで会員サイトを作成\r\nAWSでリリース（EC2）\r\n\r\n前職で培ってきた行動力・実行力を武器にプロジェクト参画後も、能動的に動き、\r\nいち早く成果を上げられるよう行動して参ります。',NULL,4,'2023-08-31 00:52:55',NULL,'2024-04-14 09:38:16',168),(169,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2023-09-01 01:03:15',NULL,'2023-09-01 01:03:15',NULL),(170,'名字','名前','ミョウジ','ナマエ','N.M','19990114',0,'谷町九丁目','1','9','2023','11','◯業務内\r\n・運用面の改善\r\n運用がうまくいっていなかった際に、gitの運用フローの変更の提案、マイグレーション移行の提案を行いました。運用の改善を行うことで、コンフリクトの解消などに取られていた全体の工数を減らす、DDLの流し忘れのような人為的なミスを減らすことを実現しました。プロジェクトでは、個人の問題、チームの問題、運用の問題を切り分け、プロジェクトを良い方向に導きます。\r\n\r\n・コードの改善\r\nプロダクトをこれから販売拡大していくにも関わらず、ロジックの複雑化によって、詳細画面表示、一覧表示を開いた際にロードアベレージが上がる、開発・修正工数が、通常の2倍以上になるという問題が発生していました。そのため、詳細画面、一覧表示周りのロジックのリファクタリングを提案し、処理のメソッド化、別クラス切り出し、処理の流れの改善を行いました。結果、10ページ同時に開くとロードアベレージが10程度になっていたものを1以下にすることに成功しました。\r\n\r\n\r\n◯業務外\r\n・チーム開発\r\n業務外では、チーム開発を行い、要件定義から実装、ドキュメントの作成、タスク管理を行なっております。\r\n\r\n・自己学習\r\nプロジェクトを円滑に進めることができるようになるために設計、テスト自動化、CI/CDの学習を行なっております。\r\nまた、フルスタックになるため、React, Next.js, Nest.jsといったJavaScript, TypeScript関連の技術の学習を行なっております。\r\n\r\n・上流工程の知識\r\n将来的には、技術力を身につけ、上流経験を積みたいと考えております。\r\nそのために、実際に上流工程に携わっているエンジニアの方から、各種仕様書の作成方法を教わっております。\r\n直近では、教わった仕様書作成方法を用いて、業務内で機能追加のために各種仕様書の作成を行いました。',NULL,NULL,'2023-09-04 01:12:53',NULL,'2023-12-28 09:18:35',1),(171,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2023-09-12 02:26:02',NULL,'2023-09-12 02:26:02',NULL),(172,'名字','名前','ミョウジ','ナマエ','N.M','19950619',0,'岸辺','3','10','2023','10','業界歴5年目で1～4年の間で開発業務に携わっております。鉄道会社の予約システムからカード会社の債権システムの保守、運用、開発を一折行っており、またカード会社での業務時には要件定義～リリース会議までの上流を含めた経験があります。また、九州の大手電力会社での運用経験もあります。\r\n業務外ではブロックチェーン、スマホアプリ開発、AI開発、ゲーム開発などの自己学習も取り組んでおり日々ITスキルの向上には取り組んでおります。自学による知識習力する能力は非常に高いです。',NULL,0,'2023-09-25 01:57:25',NULL,'2024-04-02 01:09:09',1),(173,'名字','名前','ミョウジ','ナマエ','N.M','19950126',0,'博多','0','0','2023','11','４ヶ月間プログラミングのスクールに通い１１月よりエンジニアとして働かせていただくことになりました。スクールではHTML &CSS、Ruby、Rails、インフラの基礎等を学びました。経験が足りない部分は自己学習や行動で補っていきます。よろしくお願い致します。',NULL,NULL,'2023-10-04 05:35:21',NULL,'2023-11-01 04:54:13',1),(174,'名字','名前','ミョウジ','ナマエ','N.M','19810410',0,'市営地下鉄グリーンライン北山田','18','7','2023','11','全てのことに対し、「なぜ」こうなっているのかを考え、改善の余地が少しでもあれば提案し小さい事でも1つづつ改善していくスピード感のある行動を意識し周りの意識も改善していくよう取り組んできました。知らないことにも興味を持ち、変化を楽しみ、常にチャレンジ精神をもって関係者を巻き込んだ行動をとれると自負しています。\r\n\r\nまた、IT業界では方式制御として基本設計～保守運用までをプレイングマネージャーとして従事し、Sierに寄り添った目線で開発を行っていました。\r\nイベント制作、店舗運営ではクライアント、エンドユーザ目線での思考で行動し、自分のチームだけが成功すれば良いという考えはなく、プロジェクト強いては関わる方全体の成功に向けて行動することを意識して業務に取り組んでいます。\r\n\r\n開発経験では工程は基本設計～運用保守までを経験。PM経験は11年で、細かいプロジェクトも含めると8案件でPMとして従事してきました。\r\n大規模プロジェクトだと1年間の自社開発チーム20人(240人月)の開発において、自身も開発に従事しながら受注先会社の部長を相手にプレイングマネージャーとしてプロジェクトの予算管理、要員管理、外注管理、Sierへの提案対応も実施してきました。\r\nオフショア開発でブリッジSEとしての経験もあり、\r\n直近で自身の担当していたプロジェクトの売上は約1,400万/月で年間で約17,000万でした。\r\n自身の領域の事業計画達成に向けての顧客への案件獲得推進力は自社内ではだれにも負けない自負があります。',NULL,3,'2023-10-19 08:14:05',NULL,'2024-04-02 00:38:53',1),(175,'名字','名前','ミョウジ','ナマエ','N.M','19960725',0,'糸島高校前','1','6','2024','01','Javaを用いたWebシステムの設計や開発を主に経験しており、仕様書をもとにしたプログラム作成においては基本的には自走で対応できます。\r\n常駐先での開発経験もあり、顧客の要望や疑問に対してその場で設計、開発もしていたため仕様や現場の調整もスムーズできます。\r\nまた普段の業務だけではなく、最新の言語や技術の理解、習得にも日々努めています。\r\n今後は上流工程の設計やモダン言語を用いた設計、製造を行なっていきたいです。',NULL,4,'2023-10-30 08:55:12',NULL,'2024-04-02 01:10:20',1),(176,'名字','名前','ミョウジ','ナマエ','N.M','19960726',0,'玉川上水','4','9','2024','02','・コミュニケーション力\r\n顧客の要求と完成したシステムのギャップを最小限に抑えることを常に心掛けてきました。\r\n実現のために、実際の運用環境を考慮した提案を行い、仕様や実装について顧客と深くコミュニケ\r\nーションを取りながら開発を行ってまいりました。\r\nこのアプローチにより手戻りを減らし開発の効率化と顧客満足度の向上を実現することができまし\r\nた。\r\n・マルチタスキング力\r\n私は最大3つの開発案件を同時に担当したことがあります。\r\nそれぞれの案件に対するスケジュールを自己で管理し、\r\n各案件の進行をスムーズに進めることが可能です。\r\nこの経験を活かし、新たな職場での複数の作業や案件にも対応することが可能です。\r\n・リーダーシップ\r\nリーダーとしての直接的な経験はまだありませんが、そのために必要なスキルを身につけるべく、積極的な学習と実践を続けています。たとえば、任意参加の新人教育に積極的に参加し、カリキュラムの改善提案を行っております。さらに、論理的思考を鍛え状況を客観的に分析する力を身につけるために日々、関連書籍の学習に励んでいます。\r\n・新人教育\r\n年に1回、新入社員の研修で1日間の教育担当をしています。研修中は参加者の理解度を常にチェックしながら進めること、実務に直結する具体的な事例を用いることで実践的なスキルも伝えることを心掛けました。\r\nこの経験を通じて、プレゼンテーション能力や若手育成におけるメンタリングスキルを身に着けることが出来ました。\r\nこれらのスキルを将来チームのリーダー、または教育担当者として活用することが出来ます。',NULL,4,'2023-10-30 09:05:02',NULL,'2024-02-01 07:32:26',176),(177,'名字','名前','ミョウジ','ナマエ','N.M','19981116',0,'新狭山',NULL,'0','2024','01','前職では30万円の家庭用ロボットの新規開拓営業をしていました。\r\nそこでは、新人王という賞を獲得する為に、\r\nお客様に一日100回のアプローチをすることを目標に行動して参りました。\r\n\r\n新人王は獲得することが出来ませんでしたが、\r\n繰り返しアプローチを続け、年齢層に合わせたトークやファーストコンタクトの改善など\r\nお客様のことを常に考え行動したことで強い信頼関係を構築することが出来ました。\r\n\r\nその後、プログラミングスクールに通い\r\nPHP、MVCフレームワークやフロント言語（HTML、CSS）、Webサーバー構築等を学習・経験しました。\r\nまた独学でmysql、javascriptを学習をしました。\r\n\r\n以上の経験から、困難な課題でも、アプローチを繰り返し\r\n常に改善策を考えながら行動することを心がけています。\r\nまた周りとのコミュニケーションを通じて、\r\n現場業務を円滑に進めながら開発にかかわる多くのことを吸収したいと考えています。\r\n\r\nエンジニアは常に学び続けることが大切だと考え、\r\n今後も新たな技術や知識を継続して学習していくことを常に心がけています。\r\nユーザー視点で考え、ユーザーに喜んでもらうことを自分の軸として、行動して参ります。',NULL,NULL,'2023-11-01 04:55:38',NULL,'2023-11-07 08:09:23',58),(178,'名字','名前','ミョウジ','ナマエ','N.M','19830803',0,'小田急線 高座渋谷','7','8','2023','12','私は主体的に業務にあたり、何をするべきか、どうすれば解決できるかを自主的に考え行動します。\r\nサービスや機能全体の把握に努め、任された作業以外の領域も精力的に学んでいくことで、知識を深めてまいりました。\r\nプログラミング、ネットワーク、仮想化など広い分野の知識から、機能のつながりや設定の意味などの理解、吸収が早いため、未経験の機器やソフトを扱う場合も比較的早期に一人称での作業を行ってまいりました。\r\n不明点や作業の進め方などについて積極的にコミュニケーションを取り、作業上のあいまいな点をなくすよう心掛けています。\r\nそのほか細かい調査解析や修正の提案、作業効率化のツール作成、後輩への指示・指導など、業務として見えにくい部分でも貢献してきました。\r\nまた、今後マネージャーやリーダーの経験を積みたいと考えており、日ごろから全体のスケジュールや各メンバーのタスクや負荷の状況などに気を配りながら業務に取り組んでおります。',NULL,NULL,'2023-11-09 08:57:54',NULL,'2024-04-02 00:57:24',1),(179,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2023-12-01 04:32:52',NULL,'2023-12-01 04:32:52',NULL),(180,'名字','名前','ミョウジ','ナマエ','N.M','19980716',0,'総武線西船橋','2','3','2024','03','私は、これまでC#を用いたWindowsアプリケーションの設計・開発・試験の工程を経験してきました。これらの経験を、これからのWeb開発に活かしていきたいと考えています。また、Web開発の実務経験はありませんが、C#による業務とは、別で個人的なWeb開発の学習を行ってきましたので、開発業務に少しでも活かしていければと思います。今まで経験してきた分野とは異なりますが、新しいことはどんどん吸収し、役に立てるよう、努めていきます。',NULL,3,'2023-12-06 09:39:14',NULL,'2024-04-02 00:36:23',1),(181,'名字','名前','ミョウジ','ナマエ','N.M','19810511',0,'東武スカイツリーライン　五反野','19','10',NULL,NULL,'・環境の変化に柔軟に対応でき、人見知りも少ないです。\r\n・保守開発の経験が多いため、他人の書いたプログラムの解析もあまり苦手意識がありません。\r\n・VB系エンジニアから、PHPエンジニアに転向しているため、プログラム言語の変更にも柔軟に対応できます。\r\n※過去に「Ruby ⇒ PHPへの書き換え」や「VBA ⇒ PHPへの書き換え」、「Python ⇒ PHPへの書き換え」経験もあります。\r\n・一人で考え混むことが少なく、不明点は先輩・後輩関わらず意見を求めるようにするため、問題解決へ迅速に対応できます。',NULL,0,'2024-01-31 05:43:42',NULL,'2024-02-08 15:27:51',181),(182,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2024-02-01 02:58:42',NULL,'2024-02-01 02:58:42',NULL),(183,'名字','名前','ミョウジ','ナマエ','N.M','19970825',0,'西武新宿線 沼袋','0','1','2024','04','前職は陸上自衛隊の通信科で、4年間勤務していました。\r\n自衛隊で、主に以下の能力を培いました。\r\n\r\n<継続的に努力する力>\r\n自衛隊では、自主的な学習や体力作りを継続していくことで、\r\n教育期間や通信科の検定を成績トップで通過したり、\r\nボーナスで最高ランクの査定を獲得しました。\r\n\r\n<コミュニケーション能力>\r\n訓練は必ずチームプレイです。\r\n「事前に衝突が起きそうな部分は擦り合わせをしておく」\r\n「過酷な状況でも気遣いを忘れない」\r\nといった事を意識して、全員のストレス負荷を低く職務を完遂できるように努めていました。\r\n\r\n<対応力>\r\n野外での通信システムは安定しない事も多く、その原因も多岐に渡ります。\r\nその中で、方々と調整しながら原因を探して障害対処を行っていました。\r\n\r\nプロジェクトに参画した際には上記の能力を生かし、いち早く戦力となれるよう努力していく所存です。',NULL,NULL,'2024-02-02 00:39:48',NULL,'2024-03-08 02:38:41',1),(184,'名字','名前','ミョウジ','ナマエ','N.M','19850621',0,'小田急線生田','1','3',NULL,NULL,'業務において、能動的・積極的に従事することを心掛けております。業務に関するコミュニケーションで、常に周囲と齟齬無く連携を図るよう心掛けております。',NULL,4,'2024-02-09 00:45:15',NULL,'2024-02-09 02:02:10',184),(185,'名字','名前','ミョウジ','ナマエ','N.M','19950330',0,'花小金井','1','1',NULL,NULL,'業務に関するコミュニケーションで、営業職の経験があり、常に周囲と齟齬無く連携を図るよう心掛けております。',NULL,4,'2024-02-09 00:46:57',NULL,'2024-02-09 02:03:10',185),(186,'名字','名前','ミョウジ','ナマエ','N.M','20001209',0,'永山','0','1','2024','04','前職は健康保険組合の事務員として、約半年間勤務していました。\r\n健康保険組合で、主に以下の能力を培いました。\r\n\r\n<計画力>\r\n健保組合では、その日届いた書類をその日中に処理する必要がありました。\r\nその為、日々業務の時間配分を考え、勤務時間内にすべての書類の処理が完了出来るよう\r\n計画的に業務に取り組みました。\r\n\r\n<判断力>\r\n健保組合では、扶養の認定処理で判断力を身につけました。\r\n扶養認定では、扶養申請者の家庭の生計を個別に把握する必要があるため、申請者に適宜必要な書類を提出していただき、\r\nその情報をもとに申請者が扶養していると認定できるのかを、厳密に判断するよう努めていました。\r\n\r\n<協力する力>\r\n健保組合では、各々の社員が担当企業をもっており、日により書類の量が多い人や少ない人で偏りがありました。\r\nそのため、自分の書類の量が少ない日は、多い人の業務を手助けし、協力して業務にあたることを心がけました。\r\n\r\nプロジェクトに参画した際には、いち早く戦力になれるよう、上記の能力を活かし努力していく所存です。',NULL,4,'2024-02-22 01:01:39',NULL,'2024-04-02 00:43:02',1),(187,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2024-03-04 03:51:56',NULL,'2024-03-04 03:51:56',NULL),(188,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2024-03-04 03:52:58',NULL,'2024-03-04 03:52:58',NULL),(189,'名字','名前','ミョウジ','ナマエ','N.M','19991105',0,'未定(JRなんば駅付近を予定)','1','10','2024','08','　インフラ管理とWebアプリ開発の経験があり、Webシステムに関するスキルや知識について広くカバーしています。Webアプリ開発に関してはプロジェクトリーダーとして進捗やタスクの管理も担当したため、開発フローの全体像把握と開発への主体性強化を行うことができました。\r\n　インフラ管理業務では、社内200名規模で使用されるサーバの立ち上げから運用までを担当しました。トラブル発生時は原因調査からメンテナンススケジュールの調整、トラブル解消までをおこなっています。\r\n　Webアプリ開発では要求のヒヤリングから携わり、要件定義、設計、実装、検証を担当しました。ユーザにおける開発するシステムの立ち位置を意識し、インサイトを含めた要求に応えられるような要件を目指しています。また、改修や機能追加時の効率を考慮し、各ドキュメントやソースコードレベルで可読性の高さを念頭に置いて作成しました。\r\n　実務経験のあるスキルとして、Webアプリ開発では.NET Framework(ASP.NET、VB.NET)、SQL Server、IIS、JavaScript、、HTML、CSS、Bootstrap、Visual Studioがあります。サーバ管理ではWindows Server、VMware、Powershellがあります。ソフトウェア開発ではC++があります。組み込みソフトウェア開発ではCがあります。\r\n　また、エンジニア以外の業務としてイメージセンサについての教育に携わっていました。以前イメージセンサ製造の会社に所属していたことがあり、その際はイメージセンサの原理・構造について新入社員やインターンシップ生などへの教育を担当していました。\r\n　隣接分野の経験として、学生時代は電気電子回路と通信工学を専攻しており、イメージセンサの知識も併せてトランジスタからコンピュータ、通信、ソフトウェアまでの幅広い分野について経験があります。',NULL,NULL,'2024-03-13 10:47:42',NULL,'2024-03-31 14:23:14',189),(190,'名字','名前','ミョウジ','ナマエ','N.M','',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2024-03-18 04:08:41',NULL,'2024-03-18 04:08:41',NULL),