INSERT INTO `t_user_career` VALUES (100,1,1,NULL,'202107','2022',1,'Azure環境の運用保守','Azure環境のリソース構築・運用保守',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,1,'5',NULL,NULL,NULL,1,NULL,NULL,NULL,1,1,1,1,1,NULL,0,'2022-08-01 11:41:06',NULL,'2022-08-23 09:22:31',100),(60,2,2,NULL,'202007','202206',0,'データ蓄積・加工業務','業務内容：\r\n　収集されたデータをデータベースに蓄積し、それらを抽出・加工し、マーケティングに活用できる状態にする。\r\n　仕様書を元に抽出・加工のためのバッチ処理を製造し、テストを行う。\r\n\r\n担当業務：\r\n　仕様書を元に、AWSのS3上のファイルや、RDS内のデータをTalendやシェルスクリプトを用いて抽出・加工。\r\n　その後実行テスト・エビデンスの作成。\r\n　メンバーの製造・テストした処理をチェック。\r\n　JobCenterを用いバッチ処理の自動運用、スケジュール管理を行う。',NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,'30',NULL,NULL,NULL,1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2022-08-02 04:54:17',NULL,'2022-08-23 02:31:15',60),(67,1,5,NULL,'202007','202105',0,'自動車用品店、自動車修理工場向けの業務支援システムの開発に従事。','・担当業務：プログラマ\r\n・担当工程：製造、試験\r\n・Java（Spring Boot）を用いたバックエンドWebAPIの開発。\r\n・JUnitによる単体試験の作成。\r\n\r\n※以下業務詳細\r\n\r\n①結合試験（2020/7~2020/8）\r\n案件にて製造/改修中のAPIの結合試験実施（5本）\r\n\r\n②Junit作成（2020/8~2020/11）\r\n既存APIのJunitの新規作成、改修（12本）\r\n\r\n③新規API実装（2021/12~2021/5）\r\n　エンドユーザーの報酬案分APIの作成（1本）\r\n　上記APIのユニットテスト(JUnit)の作成\r\n　結合試験の実施',NULL,NULL,NULL,NULL,NULL,1,1,NULL,NULL,NULL,NULL,'10',NULL,NULL,NULL,1,1,1,NULL,NULL,NULL,NULL,1,NULL,1,0,'2022-08-02 11:11:43',NULL,'2022-12-27 02:32:54',67),(68,1,4,NULL,'202007','202105',0,'会員基盤システム運用保守','会員基盤システムの運用保守\r\n\r\n・業務内容\r\n　・Asteriaの保守開発\r\n　・JP1の運用保守業務\r\n　・アカウント作成対応\r\n\r\n・ツール\r\n　・フローデザイナー\r\n　・Visual Studio Code\r\n　・RLogin\r\n　・Tortoise SVN\r\n　・SSMS\r\n　・MySQL Workbench\r\n　・SQLDeveloper',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,1,NULL,NULL,'3',NULL,NULL,NULL,1,1,NULL,NULL,NULL,NULL,1,1,NULL,NULL,0,'2022-08-04 13:59:41',NULL,'2023-03-06 00:49:14',68),(48,1,1,NULL,'202202','2022',1,'デジタルコンテンツ配信事業の新特典サービスのフロントページ及び管理ページの作成','デジタルコンテンツ配信事業の新特典サービスのフロントページ及び\r\n管理ページの作成を行っている。\r\n\r\nフロントページに関してはSPAとなっており、Reactでレンダリングを\r\n行うよう作成している。\r\nレンダリングする際のデータの取得はＡＰＩを利用し、取得しているが、\r\nこのＡＰＩに関してもLaravelを利用し、作成を行っている。\r\n\r\n管理ページに関してはレンダリング、データ取得共にLaravelを使用して作成している。\r\n\r\nフロントページ、管理ページ共に作成後、修正後に\r\n試験を行っている。\r\n\r\nまた、新人教育も行っており、主に週初めに前週の振り返りとその週の作業の\r\n注意点について定例を行っている。',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,'6',NULL,NULL,NULL,1,1,1,NULL,NULL,NULL,NULL,NULL,1,NULL,0,'2022-08-05 10:36:23',NULL,'2022-08-19 07:11:39',48),(68,2,6,NULL,'202004','202006',0,'プログラミング研修','薬品在庫管理システム開発\r\n\r\n業務内容\r\n・Java(Spring),PHP(Laravel)を用いたWebシステム開発\r\n\r\n担当業務\r\n・プログラミング、単体テスト\r\n\r\n詳細\r\n・MVCモデルに則ったWEB開発、データベースの基礎、\r\n　フロントエンドの作成。\r\n・Model,View,Controllerの連携による動的Webシステム構築。\r\n・データベースの作成、テーブルの作成、\r\n　DML(select,insert,update,delete)。\r\n・フロントエンドの作成として、ページネーション、\r\n　モーダル画面を作成。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'15',NULL,NULL,NULL,1,1,NULL,NULL,NULL,1,NULL,NULL,NULL,1,0,'2022-08-05 11:35:28',NULL,'2023-03-06 01:37:13',68),(42,1,1,NULL,'202207','2022',1,'融資ソリューション　電子契約システム','電子契約サービスパッケージ、当座貸越サービスパッケージ\r\nPMO\r\n・提案、要件定義\r\n・キックオフ、定例、各種MTG\r\n・環境構築、カスタマイズ\r\n・導入\r\nお客様との折衝\r\n・課題管理及び回答\r\n・要件確認、カスタマイズ\r\n・通信要件（AWS CLI, https, FTP, SFTP, Direct Connect, HULFT）\r\n内部チームとの調整（質問、仕様等の確認）\r\n・カスタマイズの仕様調整\r\n・カスタマイズの費用、工数調整',NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'5',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,NULL,0,'2022-08-05 11:52:17',NULL,'2023-01-22 09:21:37',42),(42,2,2,NULL,'202107','202206',0,'小売り電気事業者　顧客管理パッケージ','保守対応メンバーとして参画し、障害の原因調査や機能改修の設計開発から担当し、新規導入事業者向けの要件定義用の質問作成やカスタマイズの影響調査なども担当しました。\r\nまた、現場メンバーの担当割り振りや進捗管理、業務ルールの整備や周知、現場課題の整理と提案なども行いました。',NULL,NULL,1,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,'11',1,1,1,1,1,NULL,NULL,1,NULL,NULL,1,1,NULL,0,'2022-08-05 11:57:10',NULL,'2022-08-19 00:47:03',42),(42,3,3,NULL,'202104','202106',0,'会計システム　ロギング機能','オンプレ版システムのWeb版移行でログ機能の再整理を行いました。現状から要求を整理して、そこから要件・機能に落とし込み、必要な機能を順次実装していきました。\r\nまた、メンバーの進捗管理やタスク割り振り、他チームとの調整なども行いました。',NULL,NULL,1,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,'4',1,1,1,1,1,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,0,'2022-08-05 12:02:16',NULL,'2022-08-17 12:03:06',42),(42,4,4,NULL,'202102','202103',0,'品質管理ツール　メール通知機能有効化','品質管理ツ