ロジェクト対応前は、xmlに記載のURLをすべて読みこんでいたが、\r\n前日に取得したxmlと比較し、追加されたURL、削除されたURL、タグに記載された更新日が\r\n更新されたURLのみ読み込み、その部分のみを検索結果で更新されるようした。\r\n上記の基本設計、詳細設計、製造・実装、運用・保守を行いました。',NULL,NULL,NULL,NULL,1,1,NULL,NULL,NULL,NULL,NULL,'1',NULL,1,1,1,1,1,NULL,1,NULL,NULL,NULL,NULL,NULL,0,'2022-08-09 05:50:10',NULL,'2022-08-19 06:43:30',48),(48,8,8,NULL,'201807','201808',0,'検索結果のページ取得方法のカスタマイズ','前職の検索システムでは通常、顧客ページのHTMLソースのaタグを辿ってページ取得を行うが、\r\n顧客のAPIからページ情報を取得できるように対応した。\r\n検索結果への反映間隔が10分と短いため、通常検索結果の更新はデータを洗い替えするが\r\n10分間の間に更新されたデータのみ差分反映されるように対応した。\r\n上記の基本設計、詳細設計、製造・実装、運用・保守を行った。',NULL,NULL,NULL,NULL,1,1,NULL,NULL,NULL,NULL,NULL,'1',NULL,1,1,1,1,1,NULL,1,1,NULL,NULL,NULL,NULL,0,'2022-08-09 06:04:49',NULL,'2022-08-19 06:49:49',48),(48,9,9,NULL,'201709','201804',0,'ページ取得のカスタマイズ、管理ページのカスタマイズ','通常は取得するページの調整は開発者が顧客の要望を聞いて\r\nその都度調整する必要があるが、顧客サーバーにあるTSVを読み込んで\r\n取得するようにページを調整できるようにした。\r\n検索結果に表示される内容を編集できるようにしたいという要望も出てきたため、\r\n検索結果に表示されるコンテンツのタイトル、スニペット（コンテンツの概要）等を\r\n顧客側で編集できるようにした。\r\n上記の基本設計、詳細設計、製造・実装、運用・保守を行った。',NULL,NULL,NULL,NULL,1,1,NULL,NULL,NULL,NULL,NULL,'2',1,1,1,1,1,1,NULL,1,1,NULL,NULL,NULL,NULL,0,'2022-08-09 06:20:15',NULL,'2022-08-19 07:13:15',48),(48,10,10,NULL,'201607','201609',0,'リンクチェックプログラムの新機能開発','顧客側でユーザーによって管理しているページが異なる中で、\r\nリンクチェックの起点が全ユーザー共通でしか登録できず自分の管理しているページの\r\nリンクの状況が分かりにくいという課題をいただいたため、\r\nユーザーごとにリンクチェックの起点を設定できるようにした。\r\n上記の基本設計、詳細設計、製造・実装、運用・保守を行った。',NULL,NULL,NULL,NULL,1,1,NULL,NULL,NULL,NULL,NULL,'2',NULL,1,1,1,1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2022-08-09 06:25:04',NULL,'2022-08-19 06:56:16',48),(39,1,4,NULL,'202002','202101',0,'FAX送信システム開発','【案件内容】\r\nサービスの問い合わせや作業者への依頼、帳票などをFAXにて送信を行うシステムを新規開発し、既存システムとの差し替えを行う\r\n\r\n【体制】\r\nPL1名、SE6名\r\n\r\n【役割】\r\nSE\r\n\r\n【担当業務】\r\n◆開発業務\r\n・詳細設計\r\n　先行して作成された設計書を参考に対応\r\n・開発\r\n　使用言語：C#\r\n　既存システムと先行して作成されたソースを参考に対応\r\n・単体試験\r\n　パターンテストを実施',NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,'7',NULL,NULL,1,1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2022-08-09 06:48:05',NULL,'2022-10-05 11:38:24',39),(39,