0,'自社 電子版お薬手帳サービス バージョンアップ対応','自社で運営する電子版お薬手帳サービスに管理系機能を大幅追加し、グループ他社のパッケージシステムとシングルサインオンの機構を組込む案件で、要件定義～基本設計の補佐、以降のマネジメント及び製造の全般を担当しました。案件の途中で別のマネージャ職の担当者が退職したことで以降はマネージャ職も兼任しながら遂行しました。',NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'7',1,1,1,1,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,0,'2022-08-17 06:28:40',NULL,'2022-08-19 04:43:34',66),(66,5,5,NULL,'201808','201902',0,'自社 電子版お薬手帳サービス サーバリプレース','DB容量の増大とスペックアップ、運用費用のカットを目的とした\r\nサーバのリプレース案件のリーダーを担当しました。基本的なサーバ設計等はインフラに熟知しているメンバーに一任しましたが、本システムで採用しているHBase(Hadoop上のNoSQL DB)の設定、データ移行については全面的に私が担当しました。',NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3',1,1,1,1,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,0,'2022-08-17 06:31:32',NULL,'2022-08-17 07:13:27',79),(66,6,6,NULL,'201712','201801',0,'自社 電子版お薬手帳サービス 某医科大向け 他システム連携対応','某医科大発の地域医療連携システムとデータ連携を行うための案件で、\r\nリーダーとして主に上流工程を担当しました。\r\nデータ連携はサーバ間のVPNにて行い、SOAPプロトコルによるデータ送受信を行うものでしたが、案件スタート時は相手ベンダーの仕様が決まってない中の進行であったため、接続先も不明、プロトコルの仕様も不明な状態からのスタートで、大変調整に苦労した案件でした。\r\n\r\n最初は仮想対向サービスをモックで実装しメンバーをサポート、\r\n接続先が確定した段階でVPNを構築し疎通確認、対向サービスが稼働したらモックを閉じて接続先を変更して稼働確認等など、臨機応変に対処致しました。',NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3',NULL,1,1,1,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,0,'2022-08-17 06:34:12',NULL,'2022-08-17 07:13:55',79),(66,7,7,NULL,'201701','201706',0,'自社 電子版お薬手帳サービス バージョンアップ対応','自社で運営する電子版お薬手帳サービスのUIを大幅改善し\r\nスマートフォンアプリ（iOS/Android)を全面リニューアルする案件で、\r\nリーダーを担当し実装全般を担当しました。\r\n\r\n特にスマートフォンアプリについてはWEB版と同等機能を確保するため\r\nハイブリッドアプリを基軸とした構成に全面見直し、さらにQRコード読取機能が必要であることからWEB－ネイティブ間の処理を実装するなど、設計からリリースまでのほぼ全ての実装を担当しました。\r\n\r\n当時、要員も少ないうえにネイティブアプリに精通した者がおらず全てが手さぐりであったため、大変苦労した案件の一つです。',NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3',NULL,1,1,1,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,0,'2022-08-17 06:36:51',NULL,'2022-08-19 04:49:59',66),(66,8,8,NULL,'201610','201611',0,'自社 電子版お薬手帳サービス 他社お薬手帳サービス 連携対応','自社で運営する電子版お薬手帳サービスに他社電子版お薬手帳と相互データ連携を行うためのプラットフォームに対応するための案件で、リーダーを担当し実装全般を担当しました。\r\n\r\nデータ連携はサーバ間のVPNにて行い、独自プロトコル（REST様）によるデータ送受信を行うものでしたが、プラットフォ