て報告を実施する。\r\n\r\n・問い合わせ対応\r\n保守契約のある機器に関する客先からの質問事項に対応。\r\n契約に基づいて然るべき場所(保守ベンダー)へ調査の依頼を実施。\r\n依頼は用意されたメールテンプレートを使用してベンダへ送信し、場合により電話でも依頼。\r\n契約によっては客先とベンダーの間に入り取次の中継を行う場合も有り。\r\n\r\n・依頼作業対応\r\n客先や運用管理者より依頼された特定の業務の対応。\r\n事前に用意された手順書に従い、ログの採取及び提供作業をはじめ設定更新作業等の他、定期的な状況確認作業、業務報告書の作成等、多岐にわたる定型の作業を実施。\r\n\r\n・その他\r\n対象のホストに接続し、容量などの閾値を確認。\r\nシステム監視、障害発生時のお客様へのエスカレーション。\r\nお客様からシステムや機器の問い合わせがあれば担当部署やベンダーに取次ぎを行いシステムが安定稼働できるように管理。\r\n必要に応じてシステム解析に必要なログ採取なども行います。\r\n\r\n業務では基本的にWindows10の端末を使用し、メールでのやり取りはOutlook、各業務対応はIEブラウザを使用して業務を行っております。\r\n\"',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'25',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,0,'2022-08-23 13:08:51',NULL,'2022-08-23 13:08:51',NULL),(95,2,2,NULL,'202004','202006',0,'SALTO 社内研修','【詳細】\r\n社内研修にてazureとAWSのクラウドの環境を貸与していただき\r\nクラウド上でのIaaSの操作（各クラウド環境にてWindows、Linuxの仮想マシン作成、\r\n仮想ネットワークの作成、セキュリティの設定）を実施。\r\ngmailをはじめとした各種Google関連のサービスについて\r\n業務を想定した操作方法や機能の研修、\r\npowershellにつきましても基礎学習を実施しております。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,'2022-08-23 13:11:01',NULL,'2022-08-23 13:11:01',NULL),(95,3,3,NULL,'202007','202206',0,'某SI SF運用・一斉配信','【チーム体制】　計6人 (一斉配信運用・SF運用チーム)\r\nマネージャ1名、リーダー1名、メンバー：4名\r\n\r\n【担当業務】\r\n常駐先ヘルプデスク業務\r\n\r\n【案件規模】\r\n社内システム利用者　約250名程度\r\n\r\n【詳細】\r\n　・社内SF運用\r\n運用手順に従いSaleForceのデータの加工や修正、フラグの更新操作、バックアップ取得、顧客データ更新操作等の作業を担当。\r\n他、売上日報の管理やメンテナンス、各種問い合わせ対応業務等。\r\n\r\n　・配信運用\r\n営業用のメールやFAX、ダイレクトメールの配信業務。\r\n数百～数万件規模の宛先リストの作成、配信設定、問い合わせ対応。\r\n\r\n　・社内セキュリティ関連業務\r\n資産管理システムを使用し、社内端末への不許可アプリのインストールや外部記憶媒体へのデータ持ち出しの有無を確認。\r\n不正を検出した際には該当利用者にヒアリングを実施。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'6',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,0,'2022-08-23 13:18:52',NULL,'2022-08-23 13:18:52',NULL),(95,4,4,NULL,'202207','2022',1,'某SI 情報系ヘルプデスク','【チーム体制】　計5人 (情報系ヘルプデスクチーム)\r\nマネージャ1名、リーダー1名、メンバー：3名\r\n\r\n【担当業務】\r\n常駐先ヘルプデスク業務\r\n\r\n【案件規模】\r\n社内システム利用者　約350名程度\r\n\r\n【詳細】\r\n常駐先