LL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,'2023-06-19 03:48:38',NULL,'2023-06-19 03:48:38',NULL),(150,5,4,NULL,'202009','202012',0,'自社開発の花札アプリのアップデート','自社開発の花札アプリのアップデート。\r\n内部レイアウトの規則を正し、新規機能の導入。\r\n・音量調整機能\r\n・役見返し機能',NULL,NULL,NULL,NULL,NULL,1,1,NULL,NULL,NULL,NULL,'7',NULL,1,1,1,1,1,1,NULL,NULL,NULL,NULL,NULL,1,0,'2023-06-19 04:03:18',NULL,'2023-06-19 04:03:18',NULL),(150,6,3,NULL,'202101','202106',0,'自社開発物品管理アプリの開発','自社開発の物品管理アプリの開発。\r\n要件定義から基本設計・詳細設計・コーディング・レビューを行う。\r\nチーム全員でアプリの方向性を定め、要件定義書を作成。\r\n基本設計、詳細設計をする過程においてアクティビティ図を作成し、それを元に画面遷移等を含めたコーディングをした。',NULL,NULL,1,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,'7',1,1,1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2023-06-19 04:10:23',NULL,'2023-06-23 02:36:53',150),(152,1,3,NULL,'202209','202302',0,'ヘルプデスク','ユーザーPCのトラブル対応を行なっておりました。\r\n遠隔でPCにアクセスし、仮想環境とローカル環境のトラブル解決を行っておりました。\r\n\r\n1日あたり約20〜30件程。\r\n1時間あたり約3〜4件の電話対応とメール対応を併せて行っております。\r\n対応は基本的にTeam Viewerを使用した操作を行います。\r\n\r\nお問い合わせ内容につきましては主に、ソフトウェアインストール、デバイス更新、\r\n社内システムエラー解消、申請対応、Office365サービスのサポート\r\nGUIファイル操作、ネット接続不備の対応などが主な業務となります。\r\n\r\n上記と並行して、リース端末、購入端末のキッティングや端末管理業務等も担当しておりました。\r\n週に3台程度対応をしておりました。\r\nまた、内部が故障したPCを修復する業務も対応しておりました。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'6',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,0,'2023-06-20 08:06:42',NULL,'2023-06-23 05:57:42',152),(152,2,2,NULL,'202304','202306',0,'へルプデスク','自動配布ソフトウェアのエラー端末に対して遠隔操作によるソフトウェアインストールを行なっておりました。\r\nユーザにOutlookを使用し、スケジュールの管理、Team viewerを使用し遠隔操作でインストールの対応を行います。\r\nキッティング（OS初期化、マスター流し、PC初期設定、ネットワーク設定、ドメイン参加、プロキシ設定、バッチ実行、ソフトウェアインストール）',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'7',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,0,'2023-06-20 08:14:06',NULL,'2023-06-23 05:57:27',152),(118,1,3,NULL,'202211','202212',0,'Angular/TypeScript/WebViewを用いた、toC向け既存ios、Androidアプリケーションの、バグ修正、新規機能開発に向けた事前調査','Angular/TypeScript/WebViewを用いた、toC向け既存iOS、Androidアプリケーションのバグ修正の、\r\n詳細設計、コーディング、単体試験に携わり、\r\nバグ修正後、新規機能開発に向けた事前調査に携わりました。\r\n\r\nバグ修正では、ページに埋め込まれた動画が正常に再生されない問題について、\r\nアプリに再生状況のログを仕込み調査を行い、他軽微なバグの修正を行いました。\r\n\r\n新規開発では、アプリ内検索機能(アプリ内に検索項目が無い場合は、外部サイトへ遷移させる事も出来る)のmock作成。\r\nお気に入り機能のmock作成。お気に入りした項目の一覧表示、一覧の順番入れ替え機能のmock作成を行いました。\r\nまた新たにGoogle Analytics導入する予定であったため、ソースへの埋め込み方、\r\nどのような統計情報を取得出来るかの調査を行いました。',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,'4',NULL,NULL,1,NULL,1,NULL,NULL,NULL,NULL,1,1,NULL,1,0,'2023-06-28 04:27:21',NULL,'2023-06-29 21:41:43',118),(118,2,2,NULL,'202301','202303',0,'複合機のブラウザ機能における追加実装調査','複合機に対して、リモートインスペクタを使って、外部アクセスできるよう技術調査を行い、\r\n同時に不正なアクセスがされないか、セキュリティ調査を行っていました。\r\n複合機に組み込まれたブラウザ機能は、chromeの元となっている、\r\nオープンソースのchromiumがベースとなっておりました。\r\nchromiumの機能の1つである、chrome devtools protocolを使用する事で、\r\n外部より複合機にアクセスが可能であるため、chrome devtools protocolの機能1つ1つについて調べ、\r\n使用されるとセキュリティ上問題になる機能について調査を行いました。',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,'11',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,0,'2023-06-28 04:34:21',NULL,'2023-06-29 22:27:31',118),(118,3,1,NULL,'202304','',1,'Java(Servlet/JSP)を用いた既存WEBアプリの、言語等のバージョンアップ','Java6から8へのバージョンアップに伴い、使用出来なくなったアプレットを用いた画面の代替開発。\r\n推奨される記法への修正について、現在時点で事前調査、基本設計、詳細設計を行いました。\r\n現在は製造工程を行っており、単体試験まで携わる予定になっています。\r\n\r\n既存のシステムでは、画面上に地図を表示させる、地図上にピンや画像を配置する、\r\n地図を操作するといった事を、アプレットを用いて実装しておりました。\r\nそのため地図機能が全て使用出来なくなるため、\r\n代替としてJavaScriptのライブラリOpenLayersを用いて開発を行いました。\r\n開発の中で、ライブラリをOpenLayersかLeafletどちらにするかの選定調査、\r\n既存と同じ機能を実装出来るか事前にmockを作成、基本設計、詳細設計、製造を行いました。\r\n\r\nまた推奨される記法への修正については、別の方にソースのどのファイルの何行目が修正になると、\r\n纏めて頂いていたので、その情報を基にソースの修正を行いました。',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,'6',NULL,1,1,1,1,NULL,NULL,NULL,1,NULL,1,1,NULL,0,'2023-06-28 04:44:58',NULL,'2023-06-29 22:25:19',118),(153,1,3,NULL,'202111','202306',0,'ポイント広告管理システムの開発','【概要】\r\n 電子決済サービスを提供する依頼会社のために、ポイント広告の効率的な管理を目的としたシステムを開発。システムの新規開発から追加機能実装、テストまで一貫して担当。\r\n\r\n【担当フェーズ】\r\n詳細設計、製造、単体試験、結合試験\r\n\r\n【業務内容】\r\n・DB設計\r\n・API仕様書作成\r\n・API実装\r\n・単体テスト\r\n・画面実装\r\n・結合テスト\r\n・プルリクエスト作成\r\n\r\n【業務内容詳細・工夫点】\r\n■DB設計\r\nコンテンツ仕様書を参照してER図を作成。テーブル間の関連性を明確化し、必要なカラムとそのデータ型を定義。\r\n\r\n■API仕様書作成\r\nSwaggerを使用してAPI仕様書を作成。画面モックとコンテンツ仕様書を基に、必要なインターフェースを抽出し調整。エンドポイントの簡潔さを重視。\r\n\r\n■API実装\r\nJavaとSpring Bootを用いてAPIを実装。仕様書に準じたAPIの実装を行い、メソッド名の明瞭さや適切なコメントの使用でコードの可読性を確保。共通化可能な箇所は適宜共通化し、保守性を向上。\r\n\r\n■単体テスト\r\nJUnitを使用しJavaのコードに対する単体テストを実装。カバレッジが最大限になるように心掛け、全てのパターンを網羅するように努めた。\r\n\r\n■画面実装\r\n TypeScript, Vue, Nuxt.jsを用いて、画面モックとコンテンツ仕様書に従った画面を実装。コードの簡潔さと効率性を重視し、共通化可能な部分はコンポーネント化。\r\n\r\n■結合テスト\r\n仕様を正確に理解し、テスト仕様書に基づいたテストを実施。テスト仕様書でカバーできないパターンも追加で確認し、早期のバグ検出に取り組み。\r\n\r\n■プルリクエスト作成\r\nGitHubを活用し、変更点をレビュワーが理解しやすい形で共有。行った作業の明確化、動作確認したエビデンスの記録を行い、レビューがスムーズに行えるよう配慮。',NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,'8',NULL,NULL,1,1,1,1,1,1,1,NULL,NULL,NULL,NULL,0,'2023-07-02 05:37:05',NULL,'2024-03-31 10:53:48',153),(153,2,2,NULL,'202306','202309',0,'運送関係の請求書発行システムの改修','【概要】\r\n運送業界向けの請求書および領収書の発行・管理システムの改修を担当。システムの改訂から不具合修正、テスト実施まで一貫して担当。\r\n\r\n【担当フェーズ】\r\n基本設計、詳細設計、製造、単体試験、結合試験\r\n\r\n【業務内容】\r\n・基本設計書・詳細設計書の修正\r\n・不具合の改修\r\n・テスト仕様書の作成\r\n・単体テストの再実施\r\n\r\n【業務内容詳細・工夫点】\r\n■基本設計書・詳細設計書の修正\r\nクライアントと連携しながら、システム仕様と設計書間の不一致部分を修正。レビューがスムーズに進行できるよう修正箇所を明示。\r\n\r\n■不具合の改修\r\nJavaとSpringを用いてAPIとバッチを修正。JavaScript、TypeScript、Vue.jsを用いてフロントエンドを修正。コードの再利用性を高めるために共通化可能な部分を共通化。また、メソッド名を簡潔にし、複雑な処理にはコメントを追記し他の開発者も理解しやすいよう工夫。\r\n\r\n■テスト仕様書の作成\r\n改修に伴う不具合のテストケースを作成。正常系と異常系のテストを含めつつ、影響範囲の確認とデグレードの防止を特に重視。他のテストで確認できる部分は意図的に省くことで、テスト仕様書のシンプルさと網羅性を両立。\r\n\r\n■単体テストの再実施\r\n作成したテスト仕様書を基に、単体テストを再実施。特に影響範囲の確認を徹底し、デグレードが生じないことを確認。',NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,'21',NULL,NULL,NULL,1,1,1,1,NULL,NULL,NULL,1,NULL,NULL,0,'2023-07-02 05:48:52',NULL,'2024-03-31 10:52:03',153),(155,1,15,NULL,'201412','201512',0,'サービス基盤リプレイスプロジェクト','サービス基盤リプレイスプロジェクト\r\n\r\n大規模証券系システムの仮想化・物理基盤のリプレイス案件における基盤構築チームにメンバーとして参加した。\r\n\r\n【業務内容】\r\n・LinuxOS,ESXのパラメータ設計、OSインストール、初期構築\r\n・開発環境におけるvCenterサーバの構築\r\n・商用環境の物理サーバ構築(300台程度)\r\n・データセンターでのFC,LANケーブルの抜栓テスト',NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,'10',NULL,1,1,1