次システム開発','■ 書誌情報検索フォーム レイアウト修正\r\n    □ 使用技術：Vue.js（NuxtJS），Python（Django）\r\n    □ 課題 / 要望\r\n        ・現在 登録されている書誌情報を検索するフォームを、顧客が提示するレイアウトに修正\r\n    □ 課題 / 要望に対して、実施したこと\r\n        ・CSS3（Vuetify，SCSS）の調整によるフォームレイアウトの修正\r\n        ・バックエンドの取得するデータ変更\r\n    ────────────────────\r\n■ バックエンドのエラーメッセージ変更\r\n    □ 使用技術：Python（Django）\r\n    □ 課題 / 要望\r\n        ・デフォルトのエラーメッセージ（英語）を任意のメッセージ（日本語）に変更し、原因究明しやすくする。\r\n    □ 課題 / 要望に対して、実施したこと\r\n        ・ローカル環境でエラーを再現させて、エラーの発生箇所を特定し、エラーメッセージを変更\r\n    ────────────────────\r\n■ 新規ストア追加に伴う既存APIの調査と設計\r\n    □ 使用技術：Curl，MySQL，Python（Django）\r\n    □ 課題 / 要望\r\n        ・本システムに新規追加するストアの API 設計\r\n    □ 課題 / 要望に対して、実施したこと\r\n        ・新規追加するストアの現在の仕様の確認\r\n        ・現状の仕様から本システムに移行するにあたり、仕様変更が必要となる箇所の調査\r\n────────────────────\r\n※ プロジェクト人数は約 ５〜10名です。',NULL,NULL,NULL,NULL,1,1,1,NULL,1,NULL,NULL,'8',NULL,NULL,1,1,1,NULL,NULL,NULL,NULL,1,1,NULL,NULL,0,'2023-08-08 04:22:27',NULL,'2023-08-08 04:22:27',NULL),(162,2,1,NULL,'202202','202305',0,'書籍管理システム開発','■ Single Sign-On（Amazon Cognito）認証の実装処理\r\n    □ 使用技術：PHP（Laravel）\r\n    □ 課題 / 要望\r\n        ・インフラチームが構築した SSO（Amazon Cognito）認証のバックエンド処理を実装\r\n    □ 課題 / 要望に対して、実施したこと\r\n        ・フロントから Request される Google アカウントを取得し、SSO（Amazon Cognito）認証\r\n    ────────────────────\r\n■ SSO（Amazon Cognito）認証におけるユーザー認証処理の仕様書作成\r\n    □ 使用技術：OpenAPI（Swagger），PHP（Laravel）\r\n    □ 課題 / 要望\r\n        ・上述で実装した SSO（Amazon Cognito）認証におけるユーザー認証処理の仕様書作成\r\n    □ 課題 / 要望に対して、実施したこと\r\n        ・OpenAPI（Swagger）仕様を参考に、ファイル（.Yaml）作成\r\n────────────────────\r\n※ プロジェクト人数は全体（フロント，インフラを含む）で、約 10名超程度です。',NULL,NULL,NULL,NULL,NULL,1,1,NULL,NULL,NULL,NULL,'10',NULL,NULL,NULL,1,1,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,0,'2023-08-08 06:22:43',NULL,'2023-08-08 06:22:43',NULL),(163,1,4,NULL,'202108','202109',0,'コロナ支援金　データ入力','■業務内容\r\n・コロナで営業自粛した企業に対する支援金についての紙のデータをMicrosoft accessに入力する。\r\n・ファイルの先頭の単語を消去して連番を振る作業を一括で行うツールの作成\r\n\r\n■工夫した点\r\nファイルのリネームを全員で手作業で行おうとしていたので、powershellのコマンドを勉強し、短時間で作業を終わらせられるようにした。またそのことを共有し、手が空いた人は別の作業ができるようにした。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'20',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,0,'2023-08-18 01:38:29',NULL,'2023-08-18 07:23:21',163),(163,2,3,NULL,'202112','202306',0,'生活保護システム　運用・保守','■業務内容\r\n・自治体の生活保護システムの運用・保守 、問い合わせの対応\r\n・システムで使うSQLの作成\r\n・業務用ツールの作成、修正\r\n\r\n■詳細\r\n・自治体の生活保護システムの運用・保守 、問い合わせの対応\r\n生活保護システムを使用している自治体からの問い合わせ（システムの使用方法の確認や間違って登録したデータの強制修正、消去等）に対応する。\r\n\r\n・システムで使うSQLの作成\r\nシステムで利用する検索機能のための新しいSQLや、自治体ごとにカスタマイズして使うSQLを作成、修正する。\r\n内部・外部結合やサブクエリ等を多く使った長めのSQLが多かった。\r\n\r\n・業務用ツールの作成、修正\r\nシステム運用時、帳票を一括でリネームして回収したり、それを管轄部署のサーバーにコピーしたりするツールの修正や、新しく出力することになったファイル用のツールの作成を行う。\r\n\r\n■工夫した点\r\n・回収ツール自体は前からあったが、必要のないフォルダが作られたり、新しいファイルについては手作業でリネームして移動させていたので、必要に応じてツールを作成、修正して業務が円滑に進むようにした。\r\n・空いた時間に生活保護について勉強し、問い合わせに円滑に対応できるように努めた。',NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,1,NULL,'20',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,0,'2023-08-18 01:49:39',NULL,'2023-08-18 08:22:48',1),(163,3,2,NULL,'202308','202309',0,'【社内研修】実践プログラム研修','■研修内容\r\n・Progate（Java入門・javascript入門・HTML,CSS入門・MySQL入門）\r\n・Java演習問題（北ソフト工房）\r\n・Java研修（スッキリわかるJava入門・スッキリわかるサーブレット&JSP入門・Spring Boot 3 プログラミング入門）\r\n・MySQL研修（3ステップでしっかり学ぶMySQL）\r\n・Docker, Git研修（qiitaのまとめサイトより）\r\n・インフラ研修\r\n・静的Webサイト研修\r\n\r\n・追加課題\r\nMybatisとThymeleafを用いてToDoアプリ\r\n情報セキュリティマネジメント試験学習\r\n\r\n■詳細\r\n・Java研修\r\n条件分岐や繰り返し、配列やメソッドなどの基本的な操作から\r\nオブジェクト指向を用いたクラスや継承、カプセル化などを習得\r\nまた、servlet/JSPを用いたMVC設計での動的webサイトの構築の実施\r\n\r\n・MySQL研修\r\n基本のCRUD操作の習得から\r\nGROUP BY・テーブル結合・トランザクションなどの応用に加え\r\nバックアップ/リストアまで実施\r\n\r\n・Docker/Git研修\r\n様々な概念や仕組みの理解\r\nNGINX+Tomcat+DockerでWebサーバを構築\r\nDocker For Windowsを用いた開発環境の構築\r\n\r\n・インフラ研修\r\n基本的なOS・ディストリビューション・Linuxコマンドなどインフラの基礎知識の習得から\r\nWEBサーバ構築・SSL・firewallの設定など、研修(Java)で利用する為のDB開発環境の構築まで実施\r\n\r\n・静的Webサイト研修\r\nデモサイトを模写コーディングを行い、レイアウトの組み立て方、フォームの作成、動画の埋め込み等\r\nフロント作成の為の基本的なスキルを習得\r\n\r\n■工夫した点\r\n・WBSを使用して進捗管理をし、デイリーで進捗報告を実施しました。\r\n・全体スケジュールから巻きで進められていたので、\r\n　追加の研修課題として情報セキュリティマネジメント試験の学習を実施しました。\r\n・社員管理サイト、ToDoアプリ作成時にコードレビューをしてもらい、\r\n　コードのリファクタリングを実施しました。\r\n\r\n■成果物\r\n・SpringBoot\r\nCRUD操作を含む社員管理サイト\r\nMybatisとThymeleafを用いてToDoアプリ\r\n\r\n・静的Webサイト\r\nプロフィールサイト\r\nポートフォリオサイト\r\nブログサイト\r\nストアサイト\r\nメディアサイト',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,1,0,'2023-08-18 02:35:31',NULL,'2024-03-11 10:58:51',163),(166,1,4,NULL,'202302','202307',0,'サイバーセキュリティ製品 営業','■業務内容\r\n・営業\r\n・ネットワークセキュリティーコンサルティング\r\n・営業事務\r\n\r\n■詳細\r\n・営業\r\n主にエンドポイントセキュリティ製品（EDR、資産管理ツール）の販売を製品の運用をセットとして提案\r\n\r\n・ネットワークセキュリティーコンサルティング\r\nお客様へのヒアリングを基に社内のSEと連携を取りご要望にあったサービスや製品を提供。大手企業から中小企業と幅広い営業範囲での対応\r\n\r\n・営業事務\r\n販売店より頂いた案件用の概算収益書・御見積書などの作成\r\n\r\n■工夫した点\r\n・お客様のネットワークセキュリティーをより深く把握するため、エンジニアと同行し、ヒアリングを実施しました。\r\n\r\n・案件の進捗状況などを把握するため、管理表を作成しました。\r\n\r\n・取り扱っている製品が多く、金額や見積もりのミスを減らすため、役員承認の価格表を作成しました。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'10',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2023-08-21 07:03:19',NULL,'2023-08-31 00:22:36',166),(165,1,3,NULL,'202106','202209',0,'エアコンの受注発注業務（営業事務）','■業務内容\r\n　・受注発注業務（1日平均25件対応）\r\n　・請求書等各種書類の作成\r\n　・納期管理\r\n　・問い合わせ対応（メール、電話）\r\n　・来客対応\r\n\r\n■詳細\r\n　〇受注発注業務（1日平均25件対応）\r\n　　・発注書を専用のシステムに入力・印刷（またはPDF化）し、\r\n　　　内容を確認後、代理店へ発注\r\n　　・代理店から回答が来次第、二次店へ回答\r\n　〇請求書等各種書類の作成\r\n　　<請求書>\r\n　　　・毎月20日/月末に締め、金額に相違がないか確認した後発送（月平均150件）\r\n　　<その他>\r\n　　　・完成図やCAD図、納入仕様書の作成（１日平均３件）\r\n　〇納期管理\r\n　　　・長期の現場は納入予定/納入済の機種と台数をExcelに記入後、\r\n　　　　営業と二次店の担当者へ共有\r\n　〇問い合わせ対応（メール、電話）\r\n　　　・二次店からの在庫の問い合わせ対応\r\n　　　（＋在庫なしの場合、代理店へ次期納期の確認）\r\n　　　・エアコンのメンテナンス依頼の対応\r\n　　　・販売終了の機種/部品の代替品の問い合わせ対応\r\n　　　・金額（仕切）の問い合わせ対応\r\n　〇来客対応\r\n　　　・お茶出し/片付け\r\n\r\n■工夫した点\r\n　・発注書の室外機と室内機の組み合わせに問題がないかを確認し、問題がある際には注文書を流す前に二次店へ最終確認をすることを心がけていました。\r\n　・営業事務として、営業が営業活動に注力できるように業務改善に取り組みました。以前は受注発注が全て紙ベースだったところをソフトウェア導入を提案しペーパーレス化、事務作業にかかる工数を短縮。また、新入社員の教育用資料の作成などを行い、研修後すぐに作業に取りかかれるような環境づくりに注力しました。\r\n　・営業が不在の間、顧客からの問い合わせや他部署からの依頼に適切な対応を行い、正確に営業担当に引き継げるように心がけました。営業への引継ぎの際は、引継ぎ用のメールフォーマットを作成しメールで共有した上で、帰社後にも口頭での伝達を実施。結果として、顧客や他部署からの質問や依頼など漏れのない対応が実現できました。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'20',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2023-08-21 07:05:34',NULL,'2023-08-31 01:46:27',165),(165,2,2,NULL,'202212','202304',0,'コンクリート構造物の調査・診断・補修・改修工事等（一般事務）','■業務内容\r\n　・契約書作成（1日平均１件対応）\r\n　・見積書、請求書各種書類の作成/発送（1日平均10件対応）\r\n　・工期管理\r\n　・問い合わせ対応（メール、電話）\r\n　・各種データ入力作業\r\n　・CAD図作成（伏図・軸組図・劣化図等）\r\n　・入札業務\r\n　・来客対応\r\n\r\n■詳細\r\n　〇契約書作成\r\n　　・入札で落札した案件の契約書作成/発送（航空自衛隊や財務局など）\r\n　〇見積書、請求書など各種書類の作成/発送\r\n　　〈見積書〉\r\n　　・営業に指示していただいた内容で作成\r\n　　〈請求書〉\r\n　　・入札関連の請求書は指定のフォーマットがあるので、\r\n　　　担当者に確認後、作成/発送\r\n　　・日付空欄指定の請求書はExcelにて作成/発送\r\n　　・その他指定がない場合はガリバーにて作成/発送\r\n　　〈その他〉\r\n　　・入札で落札した案件の報告書作成\r\n　〇工期管理\r\n　　・契約書に記載されている契約工期を元に、Excelで管理\r\n　　・［一括請求・出来高請求］/［短期・長期］ごとに分け、\r\n　　　後期終了または請求書発行時期が近くなるタイミングで担当者へ確認\r\n　〇問い合わせ対応（メール、電話）\r\n　　・入札関連の問い合わせの電話を担当者へ引継ぎ\r\n　　（財務局や納税局など）\r\n　　・下請けからの営業電話の対応\r\n　　・担当している案件の契約書及び請求書回りの問い合わせ対応\r\n　〇各種データ入力作業\r\n　　・座席図の更新\r\n　　・切手・レターパックの在庫管理\r\n　　・郵便受・発信簿の更新\r\n　〇CAD図作成（伏図・軸組図・劣化図等）\r\n　　・意匠図などを元に指定の尺度で作成\r\n　　・調査員から劣化箇所を記入した資料を受け取り、\r\n　　　それを元に劣化図を作成（主に落札した各省/局の案件）\r\n　〇入札業務\r\n　　・入札情報サービスから入札条件を調べ共有\r\n　　・入札公告や仕様書を入手/共有\r\n　〇来客対応\r\n　　・お茶出し/片付け\r\n　　\r\n■工夫した点\r\n　・請求書や契約書等すべてにインデックスを付けて管理し、\r\n　　事務作業の効率化に注力しました。\r\n　・請求書の形式が各企業・団体によって違うので、担当の営業や\r\n　　調査員とこまめに確認することで未請求が起こらないようにしました。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'20',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2023-08-21 07:23:34',NULL,'2023-08-31 01:45:05',165),(164,1,1,NULL,'202204','202309',0,'仮想デスクトップ運用保守','■プロジェクト概要\r\nSIer子会社に常駐し、インフラエンジニアとして、\r\n上場企業４社の仮想デスクトップ運用保守業務に従事。\r\n\r\n▼仮想化基盤における主な経験工程\r\n・VMware vSphere環境の運用保守経験(基礎知識有り)\r\n・SI（設計、構築、運用スタートアップ経験）\r\n※後述の案件Dでは、パブリックDaaS環境からプライベートDaaS環境への運用移管の際、\r\n構築部隊と連携しての手順書作成や、既存スクリプトの変数変更経験がございます。\r\n\r\n▼４社共通の取組内容\r\n・クラウド環境におけるデプロイ作業\r\n・業務フロー改善（手順書作成含む）\r\n・非定型問い合わせに対するベンダー調査\r\n（VMware社、Trend Micro社、SB C&S社）\r\n\r\n▼案件A\r\nエンドユーザ：大和ライフネクスト株式会社\r\n\r\n▼概要\r\n期間：2023年3月～2023年9月\r\n役割：リーダー\r\n運用体制：2名\r\n仮想環境：VMware(オンプレミス)\r\n規模：仮想デスクトップ約3000台\r\n\r\n▼取組内容\r\n・顧客折衝（納期調整や運用フロー改善提案等）\r\n・タスクの切り出し\r\n・シェルスクリプト作成経験あり（Storage vMotion実行）\r\n・Linux OSの運用経験あり\r\n・監視設定の設定変更構築から監視テストまでを実施\r\n・システムの稼働監視\r\n※リソースひっ迫やウイルス感染状況を監視し、不具合時には対応を実施。安定稼働に向けて、セキュリティ対策（仮想デスクトップへのKB適用）も実施。\r\n・障害対応（一次及び二次）\r\n※影響範囲の大きい接続障害では、被疑箇所を特定するための切り分け、復旧作業で使用する作業計画書作成、復旧作業を実施。事象解消後、原因（急激なアクセス数増加、環境バージョンアップ等が起因）に対する恒久対応や運用によるカバーを実施。\r\n\r\n▼案件B\r\nエンドユーザ：三井住友トラストクラブ株式会社\r\n\r\n▼概要\r\n期間：2022年9月～2023年9月\r\n役割：サブリーダー\r\n運用体制：2名\r\n仮想環境：VMware(オンプレミス)\r\n規模：仮想デスクトップ約300台\r\n\r\n▼取組内容\r\n・顧客向け月次報告書作成及び顧客報告のスピーカー\r\n・マスタVM更新\r\n・Windows Server Update ServicesでのKB適用\r\n・Active Directoryのグループ作成及びユーザ登録\r\n・SQL Server Management Studioの運用及び障害対応\r\n・ロードバランサーの正常性確認\r\n・Linuxで稼働するDeep securityの設定値変更作業、デバッグログ取得手順の確立、各種ログ取得調査\r\n・システムの稼働監視\r\n※リソースひっ迫やウイルス感染状況を監視し、不具合時には対応を実施。安定稼働に向けて、セキュリティ対策（仮想デスクトップへのKB適用）も実施。\r\n・障害対応（一次及び二次）\r\n※影響範囲の大きい接続障害では、被疑箇所を特定するための切り分け、復旧作業で使用する作業計画書作成、復旧作業を実施。事象解消後、原因（急激なアクセス数増加、環境バージョンアップ等が起因）に対する恒久対応や運用によるカバーを実施。\r\n\r\n▼案件C\r\nエンドユーザ：TISインテックグループ\r\n\r\n▼概要\r\n期間：2022年5月～2022年10月\r\n役割：メンバー\r\n運用体制：3名\r\n仮想環境：Azure\r\n規模：Azure Virtual Desktop約400台\r\n\r\n▼取組内容\r\n・顧客向け月次報告書作成\r\n・マスタVM更新\r\n\r\n▼案件D\r\nエンドユーザ：東洋製罐GHD（子会社16社含む）\r\n\r\n▼概要\r\n期間：2022年4月～2023年9月\r\n役割：メンバー\r\n運用体制：4名\r\n仮想環境：VMware(オンプレミス)\r\n規模：仮想デスクトップ約8000台\r\n\r\n▼取組内容\r\n・SKYSEAでのアプリ配信及び端末権限付与\r\n・スクリプト改修\r\n・メンバーの教育（１名）',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'6',NULL,NULL,NULL,NULL,1,1,NULL,NULL,NULL,1,1,1,NULL,0,'2023-08-22 15:03:27',NULL,'2023-10-23 10:13:34',164),(130,3,2,NULL,'202306','202308',0,'GAIAプロジェクト　servicenow事前研修','■研修内容\r\n・01-1_ServiceNow_Training_ver.1.4_概要\r\n・01-2_ServiceNow_Training_ver.1.4_NeedIt\r\n・01-3_ServiceNow_Training_ver.1.4_Scripting\r\n・01-4_ServiceNow_Training_ver.1.4_Flow\r\n・01-5_ServiceNow_Training_ver.1.4_Import\r\n・01-6_ServiceNow_Training_ver.1.4_-Securing\r\n\r\n事前研修にてservicenowの全体像をつかみ、GUI操作と