体制チームのリーダーを行っており\r\nチーム全体の作業内容・進捗状況・質問応答などの管理に加えて\r\n自身もプログラムの修正変更対応を行っております。',NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'20',1,1,1,1,1,1,NULL,NULL,NULL,NULL,1,NULL,NULL,0,'2023-08-25 14:29:11',NULL,'2024-04-07 16:17:39',65),(55,6,1,NULL,'202308','202309',0,'航空関連プロジェクトの単体テスト','とある航空系案件のテスト工程を担当致しました。\r\n単体テストから結合テストの工程に携わりました。\r\n\r\n主にjunit5を利用してテストコードを書きテストの自動化を行いました。\r\n\r\nテストエビデンスなどもテストケース毎に手作業で取らないように自動化して仕様変更やソースコードの改修に強いテストコードの作成に努めました。',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,'20',NULL,NULL,NULL,NULL,1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2023-08-28 03:24:23',NULL,'2023-08-28 03:24:23',NULL),(106,4,3,NULL,'202210','202303',0,'SES -地震被害想定システム','SESにて10月~3月地震被害想定システムのマイグレーション作業を行いました。\r\n.Netのバージョン変更に伴い地図表示の変更（ActiveX→leaflet）、ActiveXにて表示していた画面をC#での書き換え。\r\n地震が起きた際の緯度・経度情報やvb側で計算された値の画面表示後、所定の位置に地図の表示を変更したりなど。主にフロント及びC#側のバックエンドメインでした。\r\nまた、被害の規模によりメールを配信する機能があり、画面をpdf化したものを添付できるように新規機能の追加を行いました。\r\nフェーズとしては基本設計の修正から結合試験まで実施しました。',NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,'10',NULL,1,1,1,1,1,NULL,NULL,1,NULL,1,NULL,NULL,0,'2023-08-29 10:15:44',NULL,'2023-08-30 09:17:33',106),(106,5,2,NULL,'202302','202303',0,'SES -災害情報確認システム','SESにて2月~3月災害情報確認の改修システムの単体試験、結合試験及び既存のバグ調査・修正を行いました。\r\n地震被害想定システムとの掛け持ちで行っておりました。\r\n内容として改修が終わったものに対しての単体テストをスポットで参画致しました。\r\n弊社で採用した未経験者をOJT研修生を参画させ教えながら案件を掛け持ちしながら行っておりました。\r\njavaのjsp/servletにて改修された内容の単体試験書・結合試験仕様書作成を行いテストを実施致しました。\r\nまたテスト自体も工程より早く終了した為、既存のバグの調査・修正を行いました。\r\n基本的にjavaのjsp/servletの修正、js部分の処理の可読性向上及び処理修正などを行いました。',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,'5',NULL,NULL,NULL,NULL,1,1,NULL,NULL,1,NULL,1,1,NULL,0,'2023-08-29 10:48:30',NULL,'2023-08-30 09:18:29',106),(108,9,5,NULL,'202210','202212',0,'冷蔵庫管理スマホアプリ開発','冷蔵庫の型番によって変わる冷蔵庫情報を表示したり、\r\n食材ごとのレシピを表示させるスマホアプリの開発をしておりました。\r\n1から作成したわけではなく、すでにリリースされているアプリのバグ修正と新機能開発となります。\r\nAngularで作られたWebアプリをWebViewを使ってスマホアプリ化しており、\r\n実質的にはWebアプリの修正と機能追加となります。\r\n機能追加としては、お気に入り機能やダークモードの設定追加などで、Googleアナリティクスの導入検討など、新機能の実装検討調査もしておりました。',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,'4',NULL,NULL,NULL,1,1,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,0,'2023-08-29 11:09:33',NULL,'2023-08-29 11:09:33',NULL),(106,6,1,NULL,'202304','',1,'SES -Javaマイグレーション案件','主にJava6からJava8のバージョン変更に伴い非互換部分の修正、Javaアプレットの代替開発といった内容となります。\r\n現段階では基本設計~単体テストまでの対応を行っております。\r\n案件開始時はサブリーダーといった立ち位置で、バージョン変更に伴い影響の出そうなソースの調査、開発環境の構築、仕様書やソースコードレビューを行いつつメンバー2名の教育等も行っておりました。\r\n8月よりチームが分かれた事により、リーダーとして新卒、未経験中途入社をメンバーに置き単体テストの実施及び仕様書作成を行いつつエンドとの打ち合わせ、工程の作成（工数計算）仕様書レビュー、ソースコードレビューになどの業務行いつつ、案件をリードしている形となります。\r\n結合テスト、総合テスト、リリースまで担当している形となります。',NULL,NULL,1,1,1,NULL,NULL,NULL,NULL,NULL,NULL,'7',NULL,1,1,1,1,1,1,1,1,NULL,1,1,NULL,0,'2023-08-30 09:30:11',NULL,'2024-02-09 05:47:30',106),(108,10,4,NULL,'202301','202303',0,'複合機に内蔵されているブラウザ機能のセキュリティ要件見直し','複合機に内蔵されているChromiumとNode.jsを使ってWebアプリを動作させているのですが、\r\nChromium経由のセキュリティホールが無いか調査したり、リモートインスペクタ機能を使って、\r\n第三者が複合機内蔵アプリを作成する際にデバッグができるよう機能拡張とセキュリティ懸念が無いか調査しておりました。',NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,'12',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,0,'2023-08-30 11:38:55',NULL,'2023-08-30 11:38:55',NULL),(108,11,3,NULL,'202304','202307',0,'空港周辺の環境監視システムのマイグレーション','空港周辺の騒音や水質などの環境情報を監視できるWebアプリのマイグレーション開発を行いました。\r\n4人のメンバーをフォローしつつ、PLとして従事しておりました。\r\nJava、DB、ブラウザなどのバージョン変更による差異を調査し、工数見積もりから、基本設計、詳細設計、製造フェーズに携わりました。\r\nまた、有料の外部ライブラリを使っていた機能を使わないよう作り直した部分もあります。',NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'6',NULL,1,1,1,NULL,NULL,NULL,NULL,1,NULL,1,1,NULL,0,'2023-08-30 11:51:14',NULL,'2023-08-30 11:51:14',NULL),(108,12,2,NULL,'202308','202311',0,'空気質可視化スマホアプリの要件定義','花粉飛散量などの空気質情報をセンサーで読み取り、その情報を可視化できるスマホアプリの要点定義を行っております。\r\nユーザー目線で有用な機能となるよう、ペルソナを洗い出し、シナリオ作成し、機能に落とし込んでいます。\r\nPLとして参画しており、エンドのお客様と直接連携をとって、要件を決めていっております。',NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'5',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2023-08-30 11:57:03',NULL,'2024-03-12 14:25:45',108),(166,2,3,NULL,'202308','',1,'【社内研修】実践プログラム研修','■研修内容\r\n・Progate（Java入門・javascript入門・HTML,CSS入門・MySQL入門）\r\n・Java演習問題（北ソフト工房）\r\n・Java研修（スッキリわかるJava入門・スッキリわかるサーブレット&JSP入門・Spring Boot 3 プログラミング入門）\r\n・MySQL研修（3ステップでしっかり学ぶMySQL）\r\n・Docker, Git研修（qiitaのまとめサイトより）\r\n・インフラ研修\r\n・静的Webサイト研修\r\n\r\n・追加課題\r\nMybatisとThymeleafを用いてToDoアプリ\r\n情報セキュリティマネジメント試験学習\r\n\r\n■詳細\r\n・Java研修\r\n条件分岐や繰り返し、配列やメソッドなどの基本的な操作から\r\nオブジェクト指向を用いたクラスや継承、カプセル化などを習得\r\nまた、servlet/JSPを用いたMVC設計での動的webサイトの構築の実施\r\n\r\n・MySQL研修\r\n基本のCRUD操作の習得から\r\nGROUP BY・テーブル結合・トランザクションなどの応用に加え\r\nバックアップ/リストアまで実施\r\n\r\n・Docker/Git研修\r\n様々な概念や仕組みの理解\r\nNGINX+Tomcat+DockerでWebサーバを構築\r\nDocker For Windowsを用いた開発環境の構築\r\n\r\n・インフラ研修\r\n基本的なOS・ディストリビューション・Linuxコマンドなどインフラの基礎知識の習得から\r\nWEBサーバ構築・SSL・firewallの設定など、研修(Java)で利用する為のDB開発環境の構築まで実施\r\n\r\n・静的Webサイト研修\r\nデモサイトを模写コーディングを行い、レイアウトの組み立て方、フォームの作成、動画の埋め込み等\r\nフロント作成の為の基本的なスキルを習得\r\n\r\n■工夫した点\r\n・WBSを使用して進捗管理をし、デイリーで進捗報告を実施しました。\r\n・全体スケジュールから巻きで進められていたので、\r\n　追加の研修課題として情報セキュリティマネジメント試験の学習を実施しました。\r\n・社員管理サイト、ToDoアプリ作成時にコードレビューをしてもらい、\r\n　コードのリファクタリングを実施しました。\r\n\r\n■成果物\r\n・SpringBoot\r\nCRUD操作を含む社員管理サイト\r\nMybatisとThymeleafを用いてToDoアプリ\r\n\r\n・静的Webサイト\r\nプロフィールサイト\r\nポートフォリオサイト\r\nブログサイト\r\nストアサイト\r\nメディアサイト',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,1,0,'2023-08-31 01:19:45',NULL,'2023-08-31 08:10:15',1),(165,3,1,NULL,'202308','',1,'【社内研修】実践プログラム研修','■研修内容\r\n・Progate（Java入門・javascript入門・HTML,CSS入門・MySQL入門）\r\n・Java演習問題（北ソフト工房）\r\n・Java研修（スッキリわかるJava入門・スッキリわかるサーブレット&JSP入門・Spring Boot 3 プログラミング入門）\r\n・MySQL研修（3ステップでしっかり学ぶMySQL）\r\n・Docker, Git研修（qiitaのまとめサイトより）\r\n・インフラ研修\r\n・静的Webサイト研修\r\n\r\n・追加課題\r\nMybatisとThymeleafを用いてToDoアプリ\r\n情報セキュリティマネジメント試験学習\r\n\r\n■詳細\r\n・Java研修\r\n条件分岐や繰り返し、配列やメソッドなどの基本的な操作から\r\nオブジェクト指向を用いたクラスや継承、カプセル化などを習得\r\nまた、servlet/JSPを用いたMVC設計での動的webサイトの構築の実施\r\n\r\n・MySQL研修\r\n基本のCRUD操作の習得から\r\nGROUP BY・テーブル結合・トランザクションなどの応用に加え\r\nバックアップ/リストアまで実施\r\n\r\n・Docker/Git研修\r\n様々な概念や仕組みの理解\r\nNGINX+Tomcat+DockerでWebサーバを構築\r\nDocker For Windowsを用いた開発