',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2023-09-01 05:15:52',NULL,'2023-09-06 01:53:34',1),(170,1,2,NULL,'202204','202310',0,'求人サイト構築パッケージ','概要\r\n人材会社向け求人サイトパッケージ。新機能の設計からコーディング、保守運用まで担当。\r\n\r\n新機能追加\r\n求人会社がフィードの文言をカスタマイズできる機能実装。\r\nバグ改修、負荷調査・改善担当。\r\n\r\n\r\n【実績】\r\nこれまで以下の課題があった。\r\n・gitの運用が固まっておらず、多い時は週に５回ほどコンフリクトが起きていた。\r\n・ファットコントローラになっていた。\r\n・クエリが冗長に呼び出されていた。\r\n・LaravelだがDDLがマイグレーション管理されておらず、タスク管理ツールにDDLを書いていた。\r\n\r\n\r\n\r\n・git運用については、github flowを参考にした運用を提案した。運用の変更を浸透させるため、ドキュメントにまとめる、口頭での説明を行った。現在は、ほとんどコンフリクトがない状態になっている。\r\n・ファットコントローラについては、初期の設計が不十分な現状のコードでは修正・機能追加の工数が3倍、4倍になっていることを説明し、求人詳細画面のリファクタリングを行った。\r\n・冗長なクエリについては、MTGを開催して現状を上長に説明し、改善を行い、クエリ数を1/8に減らした。\r\n・マイグレーションについては、新機能追加依頼の際に、DDL流し忘れ防止、管理のしやすさを上長に提案し、マイグレーション管理に移行した。\r\n\r\n\r\n【工夫点】\r\n・git運用では学習コストの低いgithub flowを採用した。プロジェクト全体のチケットをみて、コンフリクトが起こりそうな場合はチケット期限をずらすように上長に依頼している。\r\n・ファットコントローラのリファクタリングでは、クラス、メソッドに処理を切り出してまとめる、データ取得、データ整形ロジックをまとめる等を行った。\r\n・冗長なクエリの原因の１つはLaravelのリレーション機能を使わずに必要なデータ取得の際にDB接続を繰り返していたことであったため、eager loadingを利用してDB接続回数を削減した。\r\nマイグレーション移行の際、管理しているサイト全てにartisanコマンドを流すためのシェルスクリプトを作成した。',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,1,NULL,NULL,'3',1,1,1,1,1,1,NULL,NULL,1,1,1,1,NULL,0,'2023-09-04 14:23:30',NULL,'2023-09-06 04:04:19',170),(170,2,1,NULL,'202212','202310',0,'求人サイト構築','概要\r\n上記の求人サイトパッケージをコピーしたサイトをクライアント向けにカスタマイズ。新機能の設計からコーディング、保守・運用、サーバー設定まで担当。\r\n\r\n新機能追加\r\n電話番号管理サービスAPIと連携して、求人登録時に電話番号発番、着信データ集計機能を基本設計から実装まで担当。\r\nバグ改修、負荷調査・改善担当。\r\n\r\n\r\n\r\n【実績】\r\nこれまで以下の課題があった。\r\n・上記の求人サイトパッケージをコピーしているので、クライアントごとに求人情報、求人数にコードが適しておらず、すぐにサーバーが落ちる。\r\n・外部エンジニアが作成したコードの管理。\r\n\r\n\r\n・サーバーを調査して、データベース周りが負荷をかけていると推測し、DBのバッファの設定、スロークエリの解消、eager loadingの使用を行い、ロードアベレージ40から1以下で安定するようにした。\r\n・github flowを導入してプルリクエストでコードレビューできる様になったので、そこでチェックし、必要に応じて処理の変更を依頼している。\r\n\r\n【工夫点】\r\n外部の方とミスコミュニケーションを起こさないよう、必要に応じて電話でもコミュニケーションをとった。',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,1,NULL,NULL,'3',1,1,1,1,1,1,NULL,NULL,1,1,1,NULL,NULL,0,'2023-09-04 14:25:46',NULL,'20