基礎的な知識を学んだ。',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,1,'9',NULL,NULL,NULL,NULL,1,1,1,NULL,NULL,NULL,NULL,NULL,NULL,0,'2023-09-25 04:17:37',NULL,'2023-09-25 04:17:37',NULL),(172,2,11,NULL,'202004','202007',0,'鉄道会社基幹システムリプレイス(プロジェクト中断)','基幹システムのリプレイス業務で1年以上の規模のプロジェクトとしてバッチプログラム製造、修正、改修要因として携わる。\r\nDBをOracle⇒PostgreSQLに置き換わる想定であったので、両DBの仕様を把握しつつ業務に取り組む。\r\nその後、コロナウィルスの影響もありプロジェクト中断となる。',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,'50',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2023-09-25 04:21:56',NULL,'2023-09-25 04:21:56',NULL),(172,3,10,NULL,'202005','202006',0,'新規事業開拓案件','コロナウィルスでプロジェクト中止が会社内の各方面で発生したため、\r\nその間このような事態になったとしてもいいよう自社での新規事業模索会をした。\r\nAI, API, ドローン, 動画編集など多岐にあたり、私はAI, API開発を\r\nKotlin, Pythonで行った。',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,1,'12',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2023-09-25 04:25:32',NULL,'2023-09-25 04:25:32',NULL),(172,4,9,NULL,'202008','202010',0,'電力会社夜間運用対応','大手電力会社の基幹システムリプレイス後の運用対応。\r\nシステム不具合があった際はそれを報告する業務を行う。',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,1,'4',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,0,'2023-09-25 04:29:42',NULL,'2023-09-25 04:29:42',NULL),(172,5,8,NULL,'202011','202104',0,'鉄道会社インターネット予約システム機能改修・脆弱性対応','予約システム内の顧客のクレジットカードのトークン化、およびに脆弱性の対応を行う。\r\n２つのプロジェクトの同時進行で行われ、結合テスト以降は両プロジェクトを同時に行う。\r\n脆弱性対応のプロジェクトのほうを行い、セッションジャック対応としての\r\n処理を各アクションクラスに入れ込む処理を追加する。\r\n実質2人で回していた状況でもう一名が予約システムの仕様を把握していないところが見受けられたため、そちらに対しての指導も要所要所で行っております。',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,'7',NULL,NULL,NULL,1,1,1,1,NULL,NULL,NULL,NULL,NULL,NULL,0,'2023-09-25 04:37:57',NULL,'2023-09-25 04:37:57',NULL),(172,6,7,NULL,'202105','202109',0,'鉄道会社基幹システムリプレイスに伴うテスト支援','鉄道会社基幹システムリプレイスに伴うテスト支援業務を行う。\r\nDBの新旧比較やテストデータの整合性チェック業務となるが、新旧チェックにおいては検証対象が10万件以上となっていたため、それを迅速に的確に行うべくテスト検証ツールをVBAで行う。\r\nベースを1日半ほどで私が作成し、残りをPLの方が細かいチューニングを行うことで実現し、本来手作業で行うといつまでも終わらない作業を期日内で完了させることができた。',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,'5',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2023-09-25 04:42:21',NULL,'2023-09-25 04:42:21',NULL),(172,7,6,NULL,'202110','202206',0,'鉄道会社インターネット予約システム設備増設化による機能追加改修','鉄道会社の予約システムにおいて、設備名追加による機能改修業務。\r\nこちらではすでにある要件定義書より基本設計書～詳細設計書の作成まで行い、最終的には総合テストまで行った。\r\nまた、単体テストの段階で300以上のテスト件数に上り、原因としてはビジネスロジックまで修正をしたことによるが人力で期間内で行える見込みもなかったため、SeleniumIDEによるテスト自動化およびこちらによる一部負荷テストも実施する(一部の機能がAJaxの影響によりJmeterが使えなかったため)。',NULL,NULL,NULL,NULL,1,1,NULL,NULL,NULL,NULL,NULL,'5',NULL,1,1,1,1,1,1,1,NULL,NULL,1,NULL,NULL,0,'2023-09-25 04:49:34',NULL,'2023-09-25 04:49:34',NULL),(172,8,5,NULL,'202206','202209',0,'鉄道会社インターネット予約システム設備増設化による 機能追加改修','予約システム内の細かい機能追加対応や保守、改修業務を行う。\r\n半月で終わる規模の案件が複数個同時に行われ、それによる対応を行う。\r\nまた、新規メンバーが参画されたので、そのメンバーに対する教育も施す。\r\n動きとしてはリードエンジニアとしての業務とされた。',NULL,NULL,NULL,NULL,1,1,NULL,NULL,NULL,NULL,NULL,'7',NULL,1,1,1,1,1,1,1,NULL,NULL,NULL,1,NULL,0,'2023-09-25 04:55:00',NULL,'2023-09-25 04:55:00',NULL),(172,9,4,NULL,'202210','202212',0,'大手カード会社の債権管理システムの債権情報が多重表示される不具合の改修','債権管理システム上で債権情報が多重表示される不具合で影響度は低いが、ユーザー側より表記が紛らわしいとのことで改修を行った案件。\r\n結果、SQLの仕分けが正常に動いておらず、仕分け対象データが仕分けされてなくて再送され続けたことによる影響であったため、重複データをSQLで制御するように組み込む。\r\nサブリーダーとしての初めての業務でリリース会議まで一連の流れを行った。',NULL,NULL,1,NULL,1,NULL,NULL,NULL,NULL,NULL,1,'4',1,1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,0,'2023-09-25 07:08:50',NULL,'2023-09-25 07:08:50',NULL),(172,10,3,NULL,'202204','202206',0,'大手カード会社の債権管理システムの保守・リリース対 応','別の担当の方が対応された資産を請け負い、PM、部長、運用、保守それぞれに案件概要からリリース概要などの説明会議を行う。\r\n一部、Shellスクリプトの修正や指摘事項の修正を別途行う。',NULL,NULL,1,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,'4',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,0,'2023-09-25 07:13:06',NULL,'2023-09-25 07:24:39',172),(172,11,2,NULL,'202212','202306',0,'大手カード会社のイントラシステム更改','イントラシステムで抱えていたユーザー情報の保持や一部プロダクト機能の保持に対応する案件、およびにWindowsServerのサポート切れに対応する案件。\r\nイントラ環境に関係者でない人員であっても一部ユーザーの情報が見れることが元々より問題視されており、保守を行う際も別関係者との連携も必須になるため改修することに大きなボトルネックを抱えていたものを最適化を行う。\r\nまた、イントラ環境に個人情報を保持することも問題視されたのでこれを廃止し、イントラ環境から個人情報を取得していた機能は基幹システムよ