ULL,'201204','201404',0,'ヴェトナムNACCS案件','・日本無償資金協力案件として日本NACCS、CISのシステムをヴェトナム向けにサーバ構成検討、業務、サーバ、OS、DB、制御処理をリメイクし、詳細設計～製造～単体テスト～結合テスト～システムテスト～サービス開始までの全工程にて技術フォローと開発を担当。日本NACCSの関連システムのサブシステム化の対応も並行してPMとして参画しながら技術支援を対応。\r\n各工程で自信がレビュアとしても携わり、VNACCS担当のSierと同視点でレビュアとして参画。自社の品質確保における体制構築によりSier、受注元会社からの信頼を獲得しました。\r\n問合せ窓口に自身が立つことで、サーバ構成やOSパラメータ、OLTP設定等の妥当性を日本NACCSと比較し担保しました。\r\nVNACCSでの体制構築、品質確保によりSierから信頼を獲得し、後にミャンマーNACCS案件(Sierが失注)の相談も自社にしていただきました。',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,'5',NULL,NULL,1,1,1,1,1,1,1,NULL,1,NULL,NULL,0,'2023-10-19 13:29:11',NULL,'2023-10-20 19:31:50',174),(174,6,5,NULL,'201804','201806',0,'理美容訪問介護受注システム','訪問理美容管理システム構築において\r\n顧客折衝、外注管理、コスト管理、工数見積もり、進捗管理、スケジュール管理、人員管理、基本設計～結合テストを担当。\r\n自社若手PMが既に従事していた案件で進捗が芳しくない案件だったので、立て直しを目的として自社部長と自身はPM補佐で参画。\r\n主にスケジュール調整を受注元会社とできていなかった(言われるがままに進めていた)ため、改めて工数の見直し、プロジェクトの問題点洗い出し、進捗状況の確認を実施し、整理した現状を基に発注元会社の部長と自社部長、自身でスケジュール調整を行い、協力会社にも要員追加による調整を行い発注元会社と同意を得たうえで、日々のスケジュール管理/報告を自身が対応し顧客からの信頼を再構築致しました。',NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'15',NULL,1,1,NULL,1,1,1,NULL,NULL,NULL,NULL,NULL,NULL,0,'2023-10-19 13:35:29',NULL,'2023-10-20 19:47:16',174),(174,7,4,NULL,'201807','201810',0,'民間向け貿易ソリューション（概念実証）','商社が取り扱っている輸出商品の該非判定業務のOpenRules自動化概念検証\r\n\r\nSier：1名、協働会社：1名と自身の計3名で、輸出商品の該非判定の自動化検証を実施\r\n自身は技術支援として参画',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,'3',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,0,'2023-10-19 13:37:34',NULL,'2023-10-20 07:03:40',174),(174,8,3,NULL,'201811','202007',0,'大規模電気通信事業者支社間統合システム案件','・通信建設会社が現地で回線の所外・宅内工事時に使用する手持ち端末で使用するシステムの構築（配線引込～モデム・ルータ設置～開通試験～工事費提示までをシステムで一元化）\r\n・顧客折衝、外注管理、コスト管理、工数見積もり、進捗管理、スケジュール管理、人員管理、開発を担当\r\n・c++→javaへのマイグレーション対応で約200Kstepの開発。\r\n発注先会社担当の200Kstepのうち100Kstepを中国へオフショア、100Kstepは自社担当で開発\r\n・自社若手社員がSEとして参画していたので、コスト管理、工数見積もり、進捗管理、スケジュール管理について教育し、半年でPLとしてステークホルダーとの折衝以外は任せてプロジェクトを運営しました。\r\nまた、発注会社の2年目のメンバーについても、進捗管理、スケジュール管理について教育し1年でリーダとして自身で配下協力会社をまとめてプロジェクトの中核として従事されていました。',1,NULL,1,NULL,NULL,NULL,NULL,NULL,N