・フレームワークの修正対応やベンダーQAの管理、試験仕様書の作成',NULL,NULL,NULL,NULL,1,1,NULL,NULL,NULL,NULL,NULL,'3',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,1,1,NULL,NULL,0,'2023-10-28 04:36:38',NULL,'2024-03-07 05:17:21',1),(177,1,2,NULL,'202305','202308',0,'オンラインプログラミングスクール','オンラインプログラミングスクール\r\n\r\n■学習内容\r\n・PHP の特徴について\r\n・PHP の型と基本的な式について\r\n・条件分岐構文と繰り返し構文について\r\n・関数について\r\n・web フレームワークと Laravel の特徴について\r\n・ターミナルの使い方について\r\n・新規プロジェクトの作成について\r\n・MVCモデルについて\r\n\r\n■詳細\r\n・PHP学習\r\n条件分岐や繰り返し、配列などの基本的な操作から\r\nオブジェクト指向を用いたクラスや継承などを習得\r\nまた、Laravelを用いたMVC設計での動的webサイトの構築の実施\r\n\r\n・インフラ研修\r\n基本的なOS・ディストリビューション・Linuxコマンドなどインフラの基礎知識の習得から\r\nWEBサーバ構築の設定、PHPで利用する為のDB開発環境の構築まで実施\r\n\r\n■工夫した点\r\n・決済APIを使用してサブスク契約ができるように実施しました。\r\n・スクールだけではなくyoutubeやudemyにて学習を行い、Javascriptの基礎や MySQLの学習をして毎日プログラミングに触れるようにしました。\r\n\r\n■成果物\r\n・温泉アプリ\r\nCRUD操作を含むwebサイト',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',1,1,1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,'2023-11-01 07:56:35',NULL,'2023-11-07 02:32:40',1),(177,2,3,NULL,'202104','202303',0,'新規開拓営業','全国の商業施設などでお買い物に来ているお客様に商品のご提案。\r\n主に商業施設にてイベントを開催し、運搬や設営、新規開拓営業から商談、成約までを行っておりました。\r\n\r\n【営業スタイル】新規開拓 100％ 粗品配布によるアプローチ\r\n【担当地域】全国（主に東日本）\r\n【取引顧客】個人\r\n【取引商品】家庭用ロボット、通信サービス\r\n30万円の家庭用ロボットを歩いている一般顧客に粗品配布によるアプローチで販売。\r\n■実績・取り組み\r\n2022年度：成約件数　68件\r\n　　　　　年間総売上　約1900万円　目標126％達成\r\n声がけから着座接客目標を1日5件と設定。\r\n約100件お声がけをした結果5件の着座接客だったため、1日100件以上のお声がけを設定し取り組む。\r\n当初は知識不足で接客機会を逃していたので既存顧客がイベントに遊びに来た時には積極的に自分が対応し、商品情報のヒアリングをして知識をつけて自分の接客に取り組むことを続け目標を達成。\r\n\r\n■ポイント\r\n現場ディレクターとしてチームの件数獲得に繋げる。\r\n商業施設の入り口からでも目立つようにタペストリーを配置するなどイベント感を演出、ブースも開放的な形で誰でもロボットに気軽にふれられるような環境を作る。\r\n来てくださった方にイベントに興味を持ってきていただけたのか。・家族構成・ペット飼っているかなどの質問項目から自社商材を買う事に対しての魅力付けや、特別感を演出しました。結果、最短で2分の接客でのクロージングや、着座から15分程度でもクロージングができ、実績を残す事ができた。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'6',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2023-11-01 08:01:15',NULL,'2023-11-01 08:01:15',NULL),(176,1,2,NULL,'202010','202401',0,'某医療系メーカー 新規開発・保守','[開発体制]\r\n他部署からの依頼を受け