■工夫した点\r\n　・WBSを使用して進捗管理をし、デイリーで進捗報告を実施しました。\r\n　・インフラ環境の構築やコードを書く中でエラーが出た際は、まずは原因を自分で調べるようにしました。\r\n\r\n■成果物\r\n・SpringBoot\r\n　CRUD操作を含む社員管理サイト作成\r\n　MybatisとThymeleafを用いたToDoアプリ作成\r\n\r\n・静的Webサイト\r\n　プロフィールサイト\r\n　ポートフォリオサイト\r\n　ブログサイト\r\n　ストアサイト\r\n　メディアサイト',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,1,0,'2024-02-22 01:41:09',NULL,'2024-03-22 04:58:38',186),(186,2,3,NULL,'202304','202310',0,'関東百貨店健康保険組合','■業務内容\r\n 組合加入事業所の従業員の社会保険にかかわる事務作業。\r\n\r\n■工夫した点\r\n ・計画的に業務に取り組むことを意識した。\r\n　健保組合では、事業所から書類が届いたら翌営業日に保険証を事業所に発送する必要がある。\r\n　その為、書類の処理が1日でも遅れないよう、日々時間配分を考え業務に取り組んでいた。\r\n\r\n ・協力して業務に取り組むことを意識した。\r\n　各職員で担当企業をもっていたため、日により社員の業務量に差があった。\r\n　その為、自分の業務量が少ない日は業務量が多い人の業務を手伝うなど、\r\n　協力して仕事に取り組むことに努めた。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2024-02-22 02:20:54',NULL,'2024-02-22 03:01:34',1),(148,8,2,NULL,'202308','202310',0,'デモアプリ開発','フロントエンドにVue.jsとUIライブラリ（Vuetify）を使用し、バックエンドはNode.jsでモックAPIサーバを使用しました。\r\n要件定義から開発までを経験しました。',NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,'4',1,1,1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2024-02-27 12:26:40',NULL,'2024-02-27 12:26:40',NULL),(148,9,1,NULL,'202311','',1,'業務アプリ開発','react.js、Tailwind CSS、HTML、CSSを使用し、主にフロントエンドの実装を担当しております。プラットフォームはAWSを使用し、Lambda、API Gateway を用いてサーバレス構成でアプリを作成しております。\r\n現段階では基本設計から単体テストまでを実施しました。',NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,'4',NULL,1,1,1,1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2024-02-27 13:03:37',NULL,'2024-02-27 13:03:37',NULL),(168,3,1,NULL,'202311','202403',0,'法人口座開設プロジェクト','【開発業務】\r\n法人口座開設：申込フォームの作成（JSP、Mybatis、PostgreSQL）\r\n\r\n主な改修内容\r\n・機能追加\r\n　　法人情報（例：代表者名、住所など）の入力欄を追加。\r\n　　バリデーション：サーバー側とクライアント側の両方で実装。\r\n　　DBカラムの追加\r\n・jQueryを用いた改修\r\n　　表示制御: 条件に応じてフォームの表示または非表示にするロジックを実装。\r\n\r\n実装の認識齟齬のないよう要件定義、仕様書の確認とメンバーとの積極的なコミュニケーションを心がけ業務に順守しました。\r\n\r\n【テスト業務】\r\n・単体試験（IT）\r\n　　仕様変更、バグ改修の打鍵作業の実施\r\n・結合試験（