INSERT INTO `t_user_career_request` VALUES (68,'q','q','q','q','q',NULL,NULL,NULL,NULL,'q','q','q',NULL,'2022-10-27 06:02:15',68,'2022-10-27 06:02:15',68),(98,NULL,NULL,'SALTO社員と同じ現場希望','ネットワーク案件希望、もしくはAzureを触れる現場','①SALTO社員と同じ現場希望\r\n　→しばらくSALTOから1人で現場へ参画しているので、可能であればSALTO社員の方と同じ現場を希望します。\r\n②ネットワーク案件希望、もしくはAzureを触れる現場\r\n　→過去にネットワーク案件にアサインした際にやりがいを感じ、ネットワーク面白いと感じたので希望します。\r\n　→過去の案件でもAzureに触る機会が多かったので、引き続きAzureのスキルを高めていきたいと思っています。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2023-03-08 11:07:14',98,'2023-03-08 11:07:14',98),(129,'テスト案件を希望','開発案件を希望','チーム開発をしたい、SALTO社員と一緒に働きたい',NULL,'経験が浅いため、テスト案件から理解していければと考えております。\r\nまた、可能であれば開発案件にチームの一員として活躍できればと考えております。',NULL,NULL,NULL,NULL,'フルスタックエンジニア、テックリーダー、PL、PM','将来的にはマネジメントに携わりたいと考えております。\r\nまた、JavaやPHPを中心にバックエンドの開発を行なったり、ReactやVueを用いてjavascriptなどのフロントエンドもでき、dockerやAWSについても触れるようなフルスタックエンジニアに成長していきたいと考えております。',NULL,NULL,'2023-03-28 12:09:23',129,'2024-01-23 12:45:00',129),(131,NULL,NULL,'最低週1回のリモート勤務','クラウド案件への参画','リモート勤務により出勤・退勤の時間が浮き、その時間を勉強等他の時間に充てることができるため\r\nクラウド案件については、前職で縁がなかったものの挑戦したいとずっと思っていたから',NULL,NULL,NULL,NULL,'現状はスペシャリスト思考','自分の技術を磨くのが好きなため、現状はスペシャリストの方向で考えている\r\n現状、エンジニアとして経験が浅いため自分が納得するまで腕を高め、その後マネジメント等の技術領域以外にも挑戦していきたい。',NULL,NULL,'2023-04-21 15:26:39',131,'2023-04-22 04:14:58',131),(79,'リモートワーク','今まで経験したことある言語',NULL,NULL,'出勤するより自宅で作業したい。\r\n体調によりますが電車が苦しいため極力通勤をしない、もしくは近い方がいいです。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2023-05-30 11:23:50',79,'2023-05-30 12:00:36',58),(149,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'PM（プロジェクトマネージャー）','将来的には人材を教育する立場となり、ITの分野で活躍できる人材を育てたいと考えております。',NULL,NULL,'2023-06-15 03:24:49',149,'2023-06-15 03:24:49',149),(150,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'PG(4年)、運用保守(3年)、SE(6年)を経てPMを任せられる人材へ。','プロジェクトを多角的に捉え、マネジメントする立場に回りたい。',NULL,NULL,'2023-06-16 01:44:22',150,'2023-06-16 01:51:09',150),(118,'開発案件を希望','上流工程からかかわりたい','Reactを使った現場を希望',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2023-06-28 04:50:21',118,'2023-06-28 04:50:21',118),(153,'機能開発で基本設計から行う案件','クラウド、インフラに触れられる案件','要件定義ができる案件','サブリーダーやリーダーのポジションを希望','■機能開発で基本設計から行う案件\r\nこれまでの経験を通じて、機能開発のスキルを磨いてきました。今の現場でも基本設計から開発を行なっており、私の能力を最大限に活用してSALTOに貢献するために、機能開発で基本設計から行い、コードを直接書くことができる案件は必須と考えています。\r\nまた、バックエンドだけではなくフロントエンドの開発経験もある為、どちらも行える案件ですとより経験を活かせると考えています。\r\n\r\n■クラウド、インフラに触れられる案件\r\n技術領域の幅を広げる事は、多様なプロジェクトに対応できるエンジニアになるための重要なステップだと考えています。\r\n\r\n■要件定義や基本設計ができる案件 \r\nマネジメント方向へのキャリアパスを考えると、開発の全工程を経験することが重要だと理解しています。設計フェーズから参加することでプロジェクトの全体像を深く理解し、最適な解決策を提供する能力を養うことを期待しています。また、これはマネジメントに必要な視野を広げるためにも重要です。\r\n\r\n■リーダーやサブリーダーのポジションを希望\r\n過去のプロジェクトで経験した一連の開発フローを通じて得た知識とスキルを活かすことに加え、飲食店の店長としての経験を通じて培ったチームマネジメントスキルを利用して、チーム全体の生産性を向上させ、チームメンバーの技術的な成長を支援することができると考えているためです。',NULL,NULL,NULL,NULL,'プレイングマネージャー','私の長期的なキャリアビジョンは、チームを運営しつつも、自分自身が技術面でも積極的に関与する役割を担っていくことです。技術者としての深い知識と理解を保ちつつ、同時にチームの調整とマネジメントにも貢献することで、全体の生産性と品質を向上させたいと考えています。\r\n\r\n短期的な目標としては、現在の開発の経験を深めつつ、要件定義や基本設計の上流工程を行う能力を身につけることです。また、新たな技術領域への挑戦を通じて、広範囲な技術的課題に対応できるエンジニアになることを目指しています。そして、1年以内には開発リーダーとして、チーム全体の進行を指導し、同時に技術者とクライアントの間のブリッジ役も果たすようになることを目標としています。','特になし',NULL,'2023-07-02 05:16:46',153,'2024-03-28 09:59:26',153),(154,'クラウド案件を希望',NULL,NULL,NULL,'クラウドエンジニアへのキャリアアップを志望する為、その一歩としてクラウド案件への参加を希望します。',NULL,NULL,NULL,NULL,'マルチクラウドエンジニア','Azureを勉強する中でパブリッククラウドの将来性や技術としての面白さを知り、様々なクラウドを使いこなせるエンジニアになりたいと思ったからです。',NULL,NULL,'2023-07-18 14:57:59',154,'2023-07-18 15:06:25',154),(156,'PHP開発案件を希望','経験豊富な方と同じ現場を希望','テレワーク希望',NULL,'バックエンド開発は経験が無いので、自社内の有識者のもとで実務のノウハウなどを教わりながら成長していきたいです。\r\nコミュニケーションも自社内でチームなどを組んでやる方がコミュニケーションなどの面でスムーズになると考えているため。',NULL,NULL,NULL,NULL,'バックエンドエンジニア','バックエンドの知識や経験を身に着け、将来的にはフルスタックとして開発を行いたい。',NULL,NULL,'2023-07-19 10:30:28',156,'2023-07-26 02:16:45',156),(158,'上流工程から関わりたい','開発から関わりたい','モダンな技術への挑戦','SALTO社員とのチーム開発','１　優先条件\r\n (1) 上流工程から関わりたい\r\n       現在基本設計からの現場を経験しているため、上流工程からのスキルの向上を目指すため。\r\n (2)  開発から関わりたい\r\n　    技術力を伸ばしたいため。\r\n２　尚可条件\r\n (1) モダンな技術への挑戦 \r\n　　幅広い技術力を身につけるためモダン技術へも挑戦したいです。現在Reactを独学しておりますためJavaとReactの案件があればと思います。\r\n (2)  SALTO社員とのチーム開発\r\n　　社員と切磋琢磨したチーム開発を経験したいため',NULL,NULL,NULL,NULL,'プロジェクトマネージャー（段階としてメンバーからプロジェクトリーダーの後）','今までの経験を活かすため。\r\nテックリード並みの技術力を身に付けて、マネージメント領域への挑戦をする事が私の目標であるため。特に技術選定、コスト管理及び顧客折衝等プロジェクト推進の中心的な活動をしたいと考えております。','特にありません。',NULL,'2023-07-25 11:00:04',158,'2023-07-25 11:08:37',158),(162,'一次請けで開発に携える案件を希望','チームで参画できる案件を希望',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'バックエンドを主軸に、フロントエンドも扱える Web 系エンジニアとして、幅広いスキルを習得し、成長していきたいと考えています。\r\nバックエンドでは、システムの安定性とパフォーマンスの向上に寄与できる存在。フロントエンドでは、バックエンドとのシームレスな連携を実現することができるような存在になりたいと考えています。\r\nまた、最新の技術・サービスに常にアンテナを張り、AI，機械学習など… 自己研鑽を継続的に行うことで、業務への新しいアイディアやアプローチをもたらすことで、顧客の成果に貢献したいと考えています。',NULL,NULL,NULL,'2023-08-06 18:31:06',162,'2023-08-15 19:50:29',162),(164,'クラウドの運用保守経験を活かせる案件を希望','上流工程の経験を早めに積める案件を希望','SALTO社員と同じ現場を希望',NULL,'▼優先条件\r\n・クラウドの運用保守経験を活かせる案件を希望\r\n　理由：自身の経験値で自社に貢献するため。\r\n\r\n・上流工程の経験を早めに積める案件を希望\r\n　理由：顧客折衝の経験を活かし、リーダーから中間管理職を目指すことで、自社の戦線拡大に貢献するため。\r\n\r\n▼尚可条件\r\n・SALTO社員と同じ現場を希望\r\n　理由：自社先輩からのスキルトランスファーにより、自身の成長を加速できるため。\r\n　　　　そして、自分が習得したスキルを自社社員へ展開できるメリットがあるため。',NULL,NULL,NULL,NULL,'▼お客様先で目指すキャリアパス\r\n１年目：技術習得に注力しながらサブリーダーを担当\r\n２年目：リーダーを担当\r\n３～４年目：手を動かすマネージャーを担当\r\n※技術面については、今後、運用の自動化やクラウドのアーキテクトへ繋がる案件を希望いたします。\r\n\r\n▼自社で目指すキャリアパス\r\n１年目：情報セキュリティマネジメント試験勉強会の開催者\r\n　　　　運用自動化に関する勉強会で習得した新しい技術を担当案件及び社内へ展開する人。\r\n２年目：１年目の内容を継続する。','■お客様先で目指すキャリアパスの理由\r\n▼早めに上位レイヤーへ上がりたいため\r\n顧客折衝の経験を活かし、リーダーから中間管理職を目指すことで、自社の戦線拡大に貢献するため。\r\n\r\n■自社で目指すキャリアパスの理由\r\n▼新しい技術を習得しながら周囲へ展開する役回りを行うため\r\n新しい技術を取り入れることの先陣を切り、保守的な方が多いインフラエンジニアの皆さんに向けて、新しい技術を取り入れるキッカケを作り、挑戦できる組織作りに貢献するため。\r\n例えば、運用自動化勉強会への参加（マツオカさんにお話を聞いた件）し、運用が楽になる自動化、オペレーションの構築、設計構築につながるノウハウを吸収し、周囲へ展開するなど。\r\n\r\n▼勉強会の講師を担当するため\r\n情報セキュリティマネジメント試験の勉強会開催を行い、出題テーブルのナレッジ共有や過去問（CBT以前の午後問題≒現在のB問題）模擬試験を行う。\r\n\r\nまた、上記キャリアパスを実現するために、\r\n下記自己研鑽のロードマップ内容の平行実施を考えております。\r\n■自己研鑽のロードマップ（案）\r\n▼理由\r\n技術を理解できるリーダー、マネージャーを目指すため\r\n\r\n▼具体的なアクション（案）\r\n・11月１日まで：AZ-104を取得\r\n　※入社までに120～150時間程時間を作れるため、\r\n　　案件に直接役立つ資格取得をいたします。\r\n\r\n・年内から来年の夏秋：AWSのSAPまで取得\r\n・2025年以降：個人開発でサービスを運用\r\n最終的には、実務で設計構築と運用構築を行い、Terraformやpythonを触れられるようにする。\r\nコードでの自動化、SRE方面にも手を出せるよう、サービスを作って運用する。\r\nサービスの運用監視でトラフィックが大きくなったときに、運用で何ができたか、を言えるようにするため。',NULL,NULL,'2023-08-22 15:07:15',164,'2023-08-27 16:58:15',164),(130,'Java','開発',NULL,NULL,'Javaの開発業務へ携わりたいため。',NULL,NULL,NULL,NULL,'PM','チームを円滑に動かせる人材となりたいため。\r\n現段階ではまずメンバーの一員として業務をこなし、\r\nチームリーダーの補佐、チームリーダー、PMといった順でキャリアを積んでいく想定でおります。',NULL,NULL,'2023-08-25 02:41:19',130,'2023-08-25 02:41:42',130),(170,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'上流工程、マネジメントに携わりたいと考えております。','プロジェクトの円滑な運用のためには、上流工程、マネジメントが大事だと考えております。そのため、その部分に携わり、プロジェクトに貢献したいと考えております。',NULL,NULL,'2023-09-05 12:25:44',170,'2023-09-05 12:25:44',170),(174,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'まずはプロジェクトマネージャーとして現場に参画し、現場営業により案件獲得を目指す。また、配下メンバーを次期プロジェクトマネージャーに育成する。','前職のプロジェクトマネージャー(プレイングマネージャ)経験を活かし、\r\n組織のスキル、知識のボトムアップを図り、経験が浅くても能動的にプロジェクトに\r\n目的をもって取り掛かれる様、育成することで業績を上げたい。\r\nまた、自身も顧客から信頼を獲得し、相談を受け、案件の紹介をしていただけるよう推進していきたい。',NULL,NULL,'2023-10-19 13:51:28',174,'2023-10-19 13:51:28',174),(175,'上流工程から関わりたい','モダン言語を用いたシステム開発に携わりたい','出社条件を遅めに希望','リモート可','優先条件\r\n・上流工程から関わりたい\r\n⇨上流に関わることで設計、開発含むシステムを一気通貫で携わりたいため\r\n・モダン言語を用いたシステム開発に携わりたい\r\n⇨エンジニアとして技術、業務の幅を広げたいため\r\n\r\n尚可条件\r\n⇨どちらも自身が遠方からの出社のため',NULL,NULL,NULL,NULL,'PL','プロジェクトの調整やメンバーの管理等を行い、不具合の少ないシステムをリリースできるようなエンジニアになるため','特になし',NULL,'2023-11-03 10:37:46',175,'2023-11-03 10:37:46',175),(178,'設計構築案件を希望します',NULL,'未経験ですがクラウド案件を希望します','クラウド案件以外では基本設計など上流工程から携われる案件を希望します','・これまでクラウドインフラの経験がないため\r\n・上流工程の経験を積みたい',NULL,NULL,NULL,NULL,'①ひとまずクラウド案件の経験を積みたい\r\n②ゆくゆくは若手のフォローができるような人材になりたい','①新しい分野を経験して幅を広げたい\r\n②メンバーの管理や指導などに興味があるため','最寄り駅は小田急線高座渋谷駅ですが、相鉄線いずみ野駅も利用可能な距離です',NULL,'2023-11-09 12:38:06',178,'2023-11-09 12:38:06',178),(93,'インフラ案件を希望致します。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-17 14:34:53',93,'2024-01-17 14:35:38',93),(96,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-29 14:54:56',96,'2024-01-29 15:14:50',96),(91,'クラウド関連（Azure、AWSなど）、セキュリティ関連',NULL,NULL,NULL,'技術的にクラウド、セキュリティを強化していきたいためです。',NULL,NULL,NULL,NULL,NULL,NULL,'社用のため、隔週の水曜日8:30～9:30、第二金曜日は終日不在になります。',NULL,'2024-01-30 21:46:18',91,'2024-01-30 21:46:18',91),(185,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'現場リーダー','マネジメントができるようになりたいと思っています。\r\nステップアップしていきたい。','なし',NULL,'2024-02-09 01:27:40',185,'2024-02-09 01:27:40',185),(184,'クラウド案件を希望',NULL,NULL,NULL,'現在のスキルをさらに向上させていきたいため',NULL,NULL,NULL,NULL,'ゼネラリスト','広い知識、経験を持つことで、技術的、精神的にメンバーをサポートし円滑な業務遂行を実現したい。','特になし',NULL,'2024-02-09 08:23:34',184,'2024-02-09 08:23:34',184),(71,'PHP・Laravelでの開発を希望','テスターやドキュメント整備等がメインの業務になる現場は希望しない','勤務形態は下記を希望\r\n・ハイブリッド or フルリモート','フル出社またはハイブリッドになった場合、\r\n出勤時間は1時間以内を希望','◾️PHP・Laravelを希望している理由\r\n今は技術的な知識を身につけたいため、開発ができる現場を希望しており、\r\n初めは特定の言語・フレームワークの経験を最低でも2~3年積みたいため。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2024-03-03 09:40:26',71,'2024-03-03 09:47:52',71),(56,'PHP、Laravelを使用して開発が可能な現場を希望',NULL,'契約形態\r\n　第1希望：請負\r\n　第2希望：SES,ラボ','勤務形態\r\n　ハイブリッドまたはフルリモートを希望\r\n　片道1時間未満の現場を希望',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2024-03-06 07:59:57',56,'2024-03-06 08:02:54',56),(145,'PHP/laravelを使用している','リモートワーク',NULL,NULL,'PHP/laravelを使用している\r\n理由：以前の現場でPHPを使用しており、まずはPHPをしっかりと扱えるようになりたいため。また、フレームワークを扱えるようになると活躍できる場面が増えると思ったため。\r\n\r\nリモートワーク\r\n理由：満員電車、長時間の通勤が精神、身体的に負担になるため、体調管理の面でリモートワークを希望。',NULL,NULL,NULL,NULL,'PG','現場での開発の経験を積みたいと考えているため。',NULL,NULL,'2024-03-06 08:04:09',145,'2024-03-06 08:05:14',145),(75,'開発に携われる案件を希望します。',NULL,'なるべくフル出社ではなく、リモートと出社のハイブリッド、もしくは完全リモートを希望します。','言語としてはPHP、Python、Reactに携われる現場を希望します。','手を動かして開発していくのが好きな為。また、開発案件に携わって経験値を積みたいので開発案件を希望します。\r\n家が遠いので完全出社ではなく、ハイブリッドまたはリモートを希望します。\r\n言語として今まで勉強してきた、PHP、Python、Reactに携われる現場を希望します。',NULL,NULL,NULL,NULL,'スペシャリスト','技術に興味があるので、技術面でチームに貢献できるエンジニアになりたいと考えています。',NULL,NULL,'2024-03-13 14:30:45',75,'2024-03-18 09:03:06',75),(159,'開発に携われる案件を希望いたします。\r\n希望する言語：PHP/Java/Python',NULL,'フル出社でないこと','SALTO社員と同じ現場を希望','開発の経験を積むため。将来的に上流工程に携わりたいと考えているが、そのためには下流工程をしっかり経験していたほうがよいと考えているため',NULL,NULL,NULL,NULL,'スペシャリスト','設計～実装～試験までを一通りこなせるプレイヤーになる。プレイングマネージャも目指す','リモート可。出勤頻度は週1程度',NULL,'2024-03-18 08:57:13',159,'2024-03-18 08:57:13',159),(163,'開発案件（Python、PHP、Java）\r\nチームで参画できる案件','設計～リリースまで一気通貫で対応できる案件','フレックス、リモート対応',NULL,'広く通用する開発エンジニアになるため、多くの工程を経験したいから\r\n家が遠く、出社が多いと大変なため',NULL,NULL,NULL,NULL,'スペシャリスト','その分野で高度なスキルを持ち、その分野に特化した業務において優れた成果を出したいため',NULL,NULL,'2024-03-18 08:59:38',163,'2024-03-18 09:00:33',54),(160,'開発案件希望','Java(Spring bootなら尚良い)','上流工程から関わりたい','チーム開発をしたい','開発の技術力向上と開発経験を積みたいので開発案件を希望します。\r\nまた、ドキュメント作成のスキル向上もしたいので上流工程から関わりたいです。\r\nJava(Spring boot)の理由としては、会社として力を入れていく言語であり案件が豊富なため技術力向上・経験を積みたいからです。',NULL,NULL,NULL,NULL,'プロジェクトリーダー','マネジメントスキル向上・プロジェクト管理のスキルを習得したいため。',NULL,NULL,'2024-03-22 02:08:35',160,'2024-03-26 09:20:58',160),(210,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'20代は技術に対して集中していきたい、今よりも技術の経験や知識を高めていきたい。\r\n30代もしくは手前あたりから上流工程に携わっていきたいと考えています。\r\nある程度上流工程及び経験が熟してきたら後進の若い世代に繋げていけるように教育していける立場になっていきたいと考えております。その際の具体的なポジションはスペシャリスト側の立場であるか、マネジメントの立場であるかという点ではまだ決め切れていない部分があるので模索し答えを出していきたいと考えています。','特に無し',NULL,'2024-03-31 12:28:35',210,'2024-03-31 12:31:21',210),(167,NULL,NULL,'SALTO社員と同じ場所希望(ラボなどチーム開発)','(低希望)できればリモート対応可能現場','チームやSALTO社員の方がいると、わからないことがあっても精神的負担が減少するため。\r\nまた、今後のキャリアの為にできればチーム型開発希望(ラボなど)\r\n\r\nリモートに関しては、できればいいレベル(案件がなくなりそうなら考慮はそこまで不要です)',NULL,NULL,NULL,NULL,'PM・PL','同じプロジェクトでのマネジメントができるということは、自身が教える立場かつ全体把握能力や、お客様とのコミュニケーションが必須になる。\r\n自身がそれをできるようになることで、自身の市場価値を高めることができるため数年後にはリーダーとしてできるようになりたいと考えています。',NULL,NULL,'2024-04-04 01:37:44',167,'2024-04-04 01:37:44',167);
