DROP TABLE IF EXISTS `t_user_contract`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `t_user_contract` (
  `user_id` int unsigned NOT NULL COMMENT 'ユーザーID',
  `contract_name` varchar(256) DEFAULT NULL COMMENT 'お客様先',
  `working_form` int unsigned DEFAULT NULL COMMENT '勤務形態',
  `contract_cycle` tinyint unsigned DEFAULT NULL COMMENT '契約サイクル',
  `contract_status` tinyint unsigned DEFAULT NULL COMMENT 'ステータス 0:継続、1:終了',
  `continuation_month` varchar(6) DEFAULT NULL COMMENT '契約確定月',
  `end_month` varchar(6) DEFAULT NULL COMMENT '終了確定月',
  `sales_person_id` int unsigned DEFAULT NULL COMMENT '担当営業ID',
  `matter_flg` tinyint unsigned DEFAULT NULL COMMENT '案件フラグ 0:今の案件、1:次の案件、2:過去の案件',
  `continuation_flg` tinyint unsigned DEFAULT NULL COMMENT '延長フラグ 0:延長、1:延長しない、2:保留',
  `continuation_text` varchar(256) DEFAULT NULL COMMENT '延長フラグ備考',
  `continuation_modify_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '延長確認更新日',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '登録日',
  `create_id` int unsigned DEFAULT NULL COMMENT '登録者ID',
  `modify_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新日',
  `modify_id` int unsigned DEFAULT NULL COMMENT '更新者ID'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='契約管理・延長情報管理';
/*!40101 SET character_set_client = @saved_cs_client */;

